lization'=>'Localización','Backend / Cloud Scan / TipEnsure that your website is publicly accessible and not hindered by any <strong><em>Maintenance</em></strong> or <strong><em>Under construction</em></strong> page plugins.'=>'Asegúrate de que tu sitio web sea públicamente accesible y no se vea obstaculizado por ningún plugin de <strong><em>Mantenimiento</em></strong> o de página <strong><em>En construcción</em></strong>.','Backend / Cloud Scan / Things to know / HeadlineHow the scanner works'=>'Cómo funciona el escáner','Backend / Cloud Scan / TipThe scanner will visit your website and analyze the cookies and external resources that are loaded.'=>'El escáner visitará tu sitio web y analizará las cookies y los recursos externos cargados.','Backend / Cloud Scan / TipIn cases where your website is secured through HTTP authentication, kindly refer to the subsequent section for detailed guidance on HTTP authentication.'=>'Si tu sitio web está protegido con autenticación HTTP, consulta la sección siguiente para obtener orientación detallada sobre la autenticación HTTP.','Seeder / Default Service Group / DescriptionUnclassified services are services that we are in the process of classifying. Only limited information about the use of the data and its purpose is available for these services.'=>'Los servicios no clasificados son servicios que estamos en proceso de clasificar. Para estos servicios, solo se dispone de información limitada sobre el uso de los datos y su finalidad.','Seeder / Default Service Group / NameUnclassified'=>'No clasificado','Backend / Settings / LabelPlugin URL'=>'URL del plugin','Backend / Settings / HintThe URL of the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> plugin directory.'=>'La URL del directorio del plugin <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Services / OptionsProcessing Location'=>'Lugar de tratamiento','Frontend / Dialog / Table HeadlineProcessing Location'=>'Lugar de tratamiento','Backend / Dialog Settings / HintIf enabled, the appearance of the <translation-key id="Dialog">Dialog</translation-key> is delayed for two seconds.'=>'Si está activado, la aparición de la <translation-key id="Dialog">Ventana de diálogo</translation-key> se retrasa dos segundos.','Backend / Dashboard / HintThis setting should only be activated when urgently required. When activated, it generates a large number of log entries that can affect the performance of the website. The log entries can be found under <translation-key id="Navigation-System">System</translation-key> &raquo; <translation-key id="Navigation-System-Logs">Logs</translation-key>.'=>'Este ajuste solo debe activarse en caso de urgente necesidad. Cuando está activado, genera un gran número de entradas de registro que pueden afectar al rendimiento del sitio web. Las entradas de registro se encuentran en <translation-key id="Navigation-System">Sistema</translation-key> &raquo; <translation-key id="Navigation-System-Logs">Registros</translation-key>.','Backend / Init / Alert MessageSome <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> files have been blocked by a browser extension. Please deactivate your ad blocker or cookie notice blocker.'=>'Algunos archivos de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> han sido bloqueados por una extensión del navegador. Desactiva tu bloqueador de anuncios o bloqueador de aviso de cookies.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Feature">Feature</translation-key>'=>'<translation-key id="IAB-TCF-Feature">Función</translation-key>','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Purpose">Purpose</translation-key>'=>'<translation-key id="IAB-TCF-Purpose">Finalidad</translation-key>','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Special-Feature">Special Feature</translation-key>'=>'<tra