nslation-key>, therefore you do not have do modify this setting in most cases.'=>'Tu WordPress no es una <translation-key id="Multisite-Network">Red multisitio</translation-key>; por lo tanto, en la mayoría de los casos no es necesario modificar este ajuste.','Backend / IAB TCF Configure Vendors / Things to knowThis view is used solely to activate all vendors based on the purposes, features, etc. The TCF aims to display adverts from vendors for which consent has been given based on these features. Therefore, the checkboxes will not be selected again when you call them up again.'=>'Esta vista se utiliza únicamente para activar a todos los vendedores según las finalidades, funciones, etc. El objetivo del TCF es mostrar los anuncios de los vendedores para los que se ha dado el consentimiento sobre la base de estas funciones. Por lo tanto, las casillas no se volverán a seleccionar cuando vuelvas a acceder a ellas.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-Code">Code</translation-key>: Enter the language code of the language you want to add, e.g. <strong><em>de</em></strong>. The language code must be in <translation-key id="ISO-639-1">ISO 639-1</translation-key> format. You can find a list of all language codes <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes" target="_blank"><strong><em>here</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'<translation-key id="Language-Switcher-Code">Código</translation-key>: introduce el código del idioma que deseas añadir, por ejemplo, <strong><em>de</em></strong>. El código de idioma debe estar en formato <translation-key id="ISO-639-1">ISO 639-1</translation-key>. Puedes encontrar una lista de todos los códigos de idioma <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes" target="_blank"><strong><em>aquí</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-Name">Name</translation-key>: Enter the name of the language, e.g. <strong><em>German</em></strong>.'=>'<translation-key id="Language-Switcher-Name">Nombre</translation-key>: introduce el nombre del idioma, por ejemplo, <strong><em>alemán</em></strong>.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-URL">URL</translation-key>: Enter the URL of the page of the language.'=>'<translation-key id="Language-Switcher-URL">URL</translation-key>: introduce la URL de la página del idioma.','Backend / Dialog Settings / Things to know / TextThe <translation-key id="Language-Switcher">Language Switcher</translation-key> allows visitors to change the website\'s language using the <translation-key id="Dialog">Dialog</translation-key>. Once they choose a language, they\'re automatically taken to the website\'s version in that language. This feature requires a multilingual plugin or a <translation-key id="Multisite-Network">Multisite Network</translation-key>.'=>'El <translation-key id="Language-Switcher">Selector de idioma</translation-key> permite a los visitantes cambiar el idioma del sitio web mediante la <translation-key id="Dialog">Ventana de diálogo</translation-key>. Una vez que eligen un idioma, son dirigidos automáticamente a la versión del sitio web en ese idioma. Esta función requiere un plugin multilingüe o una <translation-key id="Multisite-Network">Red multisitio</translation-key>.','Backend / Dialog Settings / TableLanguage'=>'Idioma','Backend / Dialog Settings / TableLanguage Code'=>'Código de idioma','Backend / Dialog Settings / TableURL'=>'URL','Backend / Dialog Settings / Things to know / HeadlineWhat is the purpose of the <translation-key id="Language-Switcher">Language Switcher</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Language-Switche