g>. Elimina primero la <strong>{{ resource }}</strong>.','Backend / Dialog Settings / HintIf enabled, the <translation-key id="Save-Selection">Save Selection</translation-key> button will be shown to the visitor, with which the visitor can save their consent preferences. This button can be toggled on or off specifically for the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>, but it will always be visible for the <translation-key id="Dialog-Details">Dialog Details</translation-key>.'=>'Si está activado, se mostrará al visitante el botón <translation-key id="Save-Selection">Guardar selección</translation-key>, con el que podrá guardar sus preferencias de consentimiento. Este botón puede activarse o desactivarse específicamente para la <translation-key id="Dialog-Entrance">Ventana de diálogo - Entrada</translation-key>, pero siempre estará visible para la <translation-key id="Dialog-Details">Ventana de diálogo - Detalles</translation-key>.','Backend / IAB TCF Settings / Field<translation-key id="Compact-Layout">Compact Layout</translation-key>'=>'<translation-key id="Compact-Layout">Diseño compacto</translation-key>','Backend / IAB TCF Settings / HintWhen <translation-key id="Compact-Layout">Compact Layout</translation-key> is enabled, the IAB TCF dialog will be displayed in a compact layout, to improve usability on mobile devices.'=>'Cuando se activa el <translation-key id="Compact-Layout">Diseño compacto</translation-key>, la ventana de diálogo TCF de IAB se muestra en un diseño compacto, para mejorar la usabilidad en dispositivos móviles.','Backend / System Check / Table HeadlineWordPress REST API'=>'REST API de WordPress','Backend / Dialog Settings / Alert MessageDepending on applicable law, this option may not be allowed to be turned off.'=>'Dependiendo de la legislación aplicable, puede que no se permita desactivar esta opción.','Backend / Dialog Settings / LabelShow "<translation-key id="Save-Selection">Save Selection</translation-key>" Button'=>'Mostrar el botón "<translation-key id="Save-Selection">Guardar selección</translation-key>"','Backend / Global / Things to know / TextWe use the term <translation-key id="Synchronize-Translation">Translation</translation-key> to denote the texts associated with this entry. Synchronizing the <translation-key id="Translation">Translation</translation-key> will replace the texts in the selected languages with those from this entry.'=>'Utilizamos el término <translation-key id="Synchronize-Translation">Traducción</translation-key> para indicar los textos asociados a esta entrada. Al sincronizar la <translation-key id="Translation">Traducción</translation-key>, se sustituirán los textos en los idiomas seleccionados por los de esta entrada.','Backend / Cloud Scan / AlertUninstalling the <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> failed.'=>'La desinstalación del <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> ha fallado.','Backend / Cloud Scan / AlertUninstalling the <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> failed: {{ message }}'=>'La desinstalación del <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> ha fallado: {{ message }}','Backend / Cloud Scan / AlertThe package <strong><em>{{ name }}</em></strong> was successfully uninstalled.'=>'El paquete <strong><em>{{ name }}</em></strong> se ha desinstalado correctamente.','Backend / Global / Things to know / TextWe use the term <translation-key id="Synchronize-Configuration">Configuration</translation-key> to denote all settings except the texts associated with this entry. Synchronizing the <translation-key id="Configuration">Configuration</translation-key> will set the settings in the selected languages to those of this entry.'=>'Utilizamos el término <translation-key id="Synchronize-Configuration">Configuración</translation-key> para indicar todos los ajustes, excepto los textos asociados a esta entrada. Al sincronizar la <translation-key id="Configuration">Configuración</translation-key>, los ajustes en los idiomas seleccionados se ajustarán a los de esta entrada.','Backend / Cloud Scan / FieldHTTP authentication required'=>'Se requiere autenticación HTTP','Backend / Cloud Scan / FieldHTTP authentication - Password'=>'Autenticación HTTP - Contraseña','Backend / Cloud Scan / FieldHTTP authentication - Username'=>'Autenticación HTTP - Nombre de usuario','Backend / Cloud Scan / TipHTTP authentication'=>'Autenticación HTTP','Backend / Cloud Scan / TipIf your website is protected by HTTP authentication, you can enter the username and password here, to allow the scanner to access your website. The credentials will be deleted after 7 days automatically.'=>'Si tu sitio web está protegido con autenticación HTTP, puedes introducir aquí el nombre de usuario y la contraseña para permitir que el escáner acceda a tu sitio web. Las credenciales se eliminarán automáticamente al cabo de 7 días.','Backend / Global / Alert MessageThe <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> is still in use by the <strong>{{ blockingModelName }}</strong> <strong><em>{{ blockingModelLabel }}</em></strong>.'=>'El <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> aún está en uso por el <strong>{{ blockingModelName }}</strong> <strong><em>{{ blockingModelLabel }}</em></strong>.','Backend / Global / LabelAdditional Languages'=>'Idiomas adicionales','Backend / Global / LabelSynchronize Configuration'=>'Sincronizar la configuración','Backend / Global / LabelSynchronize Translation'=>'Sincronizar la traducción','Backend / Global / HintCreate this entry also for other languages.'=>'Crea esta entrada también para otros idiomas.','Backend / Global / HintSets all settings of this configuration as the configuration for the selected languages.'=>'Establece todos los ajustes de esta configuración como configuración para los idiomas seleccionados.','Backend / Global / HintSet the configuration of this entry as the configuration for the selected languages.'=>'Establece la configuración de esta entrada como configuración para los idiomas seleccionados.','Backend / Global / HintSets all texts of this translation as the texts for the selected languages. The texts are translated automatically.'=>'Establece todos los textos de esta traducción como textos para los idiomas seleccionados. Los textos se traducen automáticamente.','Backend / Global / HintSet the translation of this entry as the translation for the selected languages. The texts are translated automatically.'=>'Establece la traducción de esta entrada como traducción para los idiomas seleccionados. Los textos se traducen automáticamente.','Backend / Global / Things to know / HeadlineSynchronize <translation-key id="Synchronize-Configuration">Configuration</translation-key> Explained'=>'Explicación para sincronizar la <translation-key id="Synchronize-Configuration">Configuración</translation-key>','Backend / Global / Things to know / HeadlineSynchronize <translation-key id="Synchronize-Translation">Translation</translation-key> Explained'=>'Explicación para sincronizar la <translation-key id="Synchronize-Translation">Traducción</translation-key>','Backend / License / Alert MessageA valid license is required to use this feature of Borlabs Cookie. <a href="?page=borlabs-cookie-license">Click here</a> to enter your license key, or <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Para utilizar esta función de Borlabs Cookie se requiere una licencia válida. <a href="?page=borlabs-cookie-license">Haz clic aquí</a> para introducir tu clave de licencia o <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>haz clic aquí</span><span class="brlbs-cmpnt-external-link-icon"></span></a> para acceder a tu cuenta y renovar la licencia.','Backend / License / Alert MessageYour license key is not valid for this version. This version of Borlabs Cookie was released after your license has expired, therefore you have to <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Tu clave de licencia no es válida para esta versión. Esta versión de Borlabs Cookie se publicó después de la expiración de tu licencia; por tanto, debes <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>hacer clic aquí</span><span class="brlbs-cmpnt-external-link-icon"></span></a> para acceder a tu cuenta y renovar la licencia.','Backend / License / Alert MessagePlease renew your license key to receive updates. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Renueva tu clave de licencia para recibir actualizaciones. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Haz clic aquí</span><span class="brlbs-cmpnt-external-link-icon"></span></a> para acceder a tu cuenta y renovar la licencia.','Backend / License / Alert MessageYour license has expired. This feature is not available with an expired license. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Click here</span><span class="brlbs-c