anslation-key id="HOTFIX">HOTFIX</translation-key>, respectively.<br><br>'=>'El número de versión estándar sigue el formato 1.0.3.0, donde los segmentos representan <translation-key id="MAJOR">PRINCIPAL</translation-key>, <translation-key id="MINOR">SECUNDARIA</translation-key>, <translation-key id="PATCH">PARCHE</translation-key> y <translation-key id="HOTFIX">HOTFIX</translation-key>, respectivamente.<br><br>','Backend / Dashboard / Hint<translation-key id="No-automatic-update">No automatic update</translation-key>: Automatic updates are disabled; you must update manually.'=>'<translation-key id="No-automatic-update">Ninguna actualización automática</translation-key>: las actualizaciones automáticas están desactivadas; es necesario actualizar manualmente.','Backend / Cloud Scan / TipNote: This column may be empty if the cookie is loaded from another resource, but for which a package is suggested. Once the suggested package is installed, the entry with the blank suggestion column is likely to be removed in the subsequent scan.'=>'Nota: esta columna puede estar vacía si la cookie se carga desde otro recurso, pero se sugiere un paquete. Una vez instalado el paquete sugerido, es probable que la entrada con la columna de sugerencia en blanco se elimine en el escaneo posterior.','Backend / Cloud Scan / TipNote: This column may be empty if the resource is loaded from another resource, but for which a package is suggested. Once the suggested package is installed, the entry with the blank suggestion column is likely to be removed in the subsequent scan.'=>'Nota: esta columna puede estar vacía si el recurso se carga desde otro recurso, pero se sugiere un paquete. Una vez instalado el paquete sugerido, es probable que la entrada con la columna de sugerencia en blanco se elimine en el escaneo posterior.','Backend / Settings / HintNumber of days until the visitor is asked again for their consent, if the user has only given consent to essential <translation-key id="Services">Services</translation-key>. Remember to adjust the <translation-key id="Cookie-Lifetime">Cookie Lifetime</translation-key> information of the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Cookie">Cookie</translation-key> under <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Número de días hasta que se vuelva a pedir el consentimiento del visitante, si el usuario solo ha dado su consentimiento para <translation-key id="Services">Servicios</translation-key> esenciales. Recuerda ajustar la información sobre la <translation-key id="Cookie-Lifetime">Duración</translation-key> de la <translation-key id="Cookie">Cookie</translation-key> de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en <translation-key id="Services">Servicios</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Library / Alert MessageAll copyrights, trademarks, and other intellectual property rights mentioned or displayed in this library belong to their respective owners. Unless explicitly stated, these entities are not affiliated, endorsed by, or in any way associated with us.'=>'Todos los derechos de autor, las marcas comerciales y otros derechos de propiedad intelectual mencionados o mostrados en esta biblioteca pertenecen a sus respectivos propietarios. A menos que se indique explícitamente, estas entidades no están afiliadas, respaldadas ni asociadas de ningún modo con nosotros.','Backend / System Check / Table HeadlineLibrary Database Last Check with API'=>'Última verificación de la base de datos de la biblioteca con la API','Backend / IAB TCF Cookie Box / Text<translation-key id="Tcf-Topic-Personal-Data">Personal Data</translation-key> - Description'=>'<translation-key id="Tcf-Topic-Personal-Data">Datos personales</translation-key> - Descripción','Backend / Settings / Label<tran