 prestan siempre. Un <translation-key id="Service-Group">Grupo de servicios</translation-key> activo solo se muestra en la <translation-key id="Dialog">Ventana de diálogo</translation-key> si tiene asignado al menos un <translation-key id="Service">Servicio</translation-key> activo.','Backend / Service Groups / Things to know / TextThe <translation-key id="Service-Group">Service Group</translation-key> is active and displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service-Group">Service Group</translation-key>: <translation-key id="Essential">Essential</translation-key>.'=>'El <translation-key id="Service-Group">Grupo de servicios</translation-key> está activo y se muestra en la <translation-key id="Dialog">Ventana de diálogo</translation-key>. No disponible para el <translation-key id="Service-Group">Grupo de servicios</translation-key>: <translation-key id="Essential">Esenciales</translation-key>.','Backend / Service Groups / Things to know / TextDelete the <translation-key id="Service-Group">Service Group</translation-key>. Not available for default <translation-key id="Service-Groups">Service Groups</translation-key>.'=>'Eliminar el <translation-key id="Service-Group">Grupo de servicios</translation-key>. No disponible para los <translation-key id="Service-Groups">Grupos de servicios</translation-key> predeterminados.','Backend / Service Groups / Things to know / TextEdit the <translation-key id="Service-Group">Service Group</translation-key>.'=>'Modificar el <translation-key id="Service-Group">Grupo de servicios</translation-key>.','Backend / Service Groups / Things to know / TextThe <translation-key id="Service-Group">Service Group</translation-key> is inactive and not displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service-Group">Service Group</translation-key>: <translation-key id="Essential">Essential</translation-key>.'=>