n-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> necesitan activar esta opción. Si no sabes si necesitas esta opción, no la necesitarás.','Backend / Settings / BreadcrumbSettings'=>'Ajustes','Backend / Settings / LabelAggregate Consents'=>'Agregar los consentimientos','Backend / Settings / LabelAutomatic Domain and Path Detection'=>'Detección automática del dominio y la ruta','Backend / Settings / Label<translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>'=>'<translation-key id="Borlabs-Cookie-Status">Estado de Borlabs Cookie</translation-key>','Backend / Settings / LabelDomain'=>'Dominio','Backend / Settings / LabelCookie Lifetime in Days'=>'Duración de las cookies en días','Backend / Settings / LabelCookie Lifetime in Days - Essential Only'=>'Duración de las cookies en días - Solo Esenciales','Backend / Settings / LabelPath'=>'Ruta','Backend / Settings / Label<translation-key id="Secure-Attribute">Secure attribute</translation-key>'=>'<translation-key id="Secure-Attribute">Atributo Secure</translation-key>','Backend / Settings / LabelCookie Version'=>'Versión de la cookie','Backend / Settings / LabelCookies for Bots/Crawlers'=>'Cookies para bots/crawlers','Backend / Settings / LabelCross Cookie Domains'=>'Cookie interdominio - Dominios','Backend / Settings / LabelDisplay Meta Box'=>'Mostrar la meta box','Backend / Settings / LabelReload After Opt-in'=>'Volver a cargar después de la aceptación','Backend / Settings / LabelReload After Opt-out'=>'Volver a cargar después del rechazo','Backend / Settings / LabelSetup Mode'=>'Modo de configuración','Backend / Settings / Label<translation-key id="UpdateCookieVersionForceRe-Selection">Update Cookie Version &amp; Force Re-Selection</translation-key>'=>'<translation-key id="UpdateCookieVersionForceRe-Selection">Actualizar la versión de la cookie &amp; Forzar la reselección</translation-key>','Backend / Settings / HeadlineCookie Settings'=>'Ajustes de cookies','Backend / Settings / HeadlineGeneral Settings'=>'Ajustes generales','Backend / Cookie Box / HeadlineReset General Settings'=>'Restablecer los ajustes generales','Backend / Settings / HintAggregate the consents of all WordPress sites in one table.'=>'Agrega los consentimientos de todos los sitios WordPress en una tabla.','Backend / Settings / Hint<translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> tries to automatically detect domain and path.'=>'<translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> intenta detectar automáticamente el dominio y la ruta.','Backend / Settings / HintActivates <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> on your website. Displays the <translation-key id="Dialog">Dialog</translation-key> and blocks iframes and other external media.'=>'Activa <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en tu sitio web. Muestra la <translation-key id="Dialog">Ventana de diálogo</translation-key> y bloquea iframes y otros medios externos.','Backend / Settings / HintSpecify the domain scheme for which the cookie is valid. Example: If you enter <strong><em>example.com</em></strong> the cookie is also valid for subdomains like <strong><em>shop.example.com</em></strong>.'=>'Especifica el esquema del dominio para el que es válida la cookie. Ejemplo: si introduces <strong><em>example.com</em></strong>, la cookie también será válida para subdominios como <strong><em>shop.example.com</em></strong>.','Backend / Settings / HintNumber of days until the visitor is asked again for their consent. Remember to adjust the <translation-key id="Cookie-Lifetime">Cookie Lifetime</translation-key> information of the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Cookie">Cookie</translation-key> under <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Número de días hasta que se vuelva a pedir el consentimiento al visitante. Recuerda ajustar la información sobre la <translation-key id="Cookie-Lifetime">Duración</translation-key> de la <translation-key id="Cookie">Cookie</translation-key> de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en <translation-key id="Services">Servicios</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Settings / HintThe path for which the cookie is valid. Default path: <strong>{{ networkPath }}</strong>'=>'La ruta para la que es válida la cookie. Ruta predeterminada: <strong>{{ networkPath }}</strong>','Backend / Settings / HintThe <translation-key id="SameSite-Attribute">SameSite attribute</translation-key> defines how the browser should handle cookies in cross-site requests. We recommend using the <strong>Lax</strong> option.'=>'El <translation-key id="SameSite-Attribute">Atributo SameSite</translation-key> define la manera en que el navegador debe manejar las cookies en las peticiones entre sitios. Recomendamos utilizar la opción <strong>Lax</strong>.','Backend / Settings / HintA cookie with the <translation-key id="Secure-Attribute">Secure attribute</translation-key> is sent to the server only in case of an encrypted request via the HTTPS protocol.'=>'Una cookie con el <translation-key id="Secure-Attribute">Atributo Secure</translation-key> solo se envía al servidor en caso de una petición cifrada a través del protocolo HTTPS.','Backend / Settings / HintShows the version of the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Increases with activating <translation-key id="UpdateCookieVersionForceRe-Selection">Update Cookie Version &amp; Force Re-Selection</translation-key>.'=>'Muestra la versión de la cookie de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Aumenta con la activación de <translation-key id="UpdateCookieVersionForceRe-Selection">Actualizar la versión de la cookie &amp; Forzar la reselección</translation-key>.','Backend / Settings / HintA bot/crawler is treated like a visitor who accepted all <translation-key id="Services">Services</translation-key>.'=>'Un bot/crawler es tratado como un visitante que ha aceptado todos los <translation-key id="Services">Servicios</translation-key>.','Backend / Settings / HintAdd one URL per line. Insert WordPress Address (URL). URL must end with <strong>/</strong>. Consent will be shared between websites.'=>'Añade una URL por línea. Introduce la dirección de WordPress (URL). La URL debe terminar en <strong>/</strong>. El consentimiento será compartido entre sitios web.','Backend / Settings / HintDisplay the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Meta-Box">Meta Box</translation-key> on the selected post types. The <translation-key id="Meta-Box">Meta Box</translation-key> allows you to add custom JavaScript on specific pages.'=>'Muestra la <translation-key id="Meta-Box">Meta box</translation-key> de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en los tipos de entradas seleccionados. La <translation-key id="Meta-Box">Meta box</translation-key> te permite añadir JavaScript personalizado en páginas específicas.','Backend / Settings / HintIf enabled, the website will be reloaded after the visitor saves their consent.'=>'Si está activado, el sitio web se volverá a cargar después de que el visitante guarde su consentimiento.','Backend / Settings / HintIf enabled, the website will be reloaded after the visitor opt out.'=>'Si está activado, el sitio web se volverá a cargar después de que el visitante opte por el rechazo.','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Settings">Settings</translation-key> settings. They will be reset to their default settings.'=>'Confirma que deseas restablecer todos los <translation-key id="Settings">Ajustes</translation-key>. Se restablecerán los ajustes predeterminados.','Backend / Settings / HintA visitor with active <translation-key id="Do-Not-Track">&quot;Do Not Track&quot;</translation-key> setting will not see the <translation-key id="Dialog">Dialog</translation-key> and <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> automatically selects the <translation-key id="Accept-Only-Essential">Accept Only Essential</translation-key> option.'=>'Un visitante con el ajuste <translation-key id="Do-Not-Track">&quot;No rastrear&quot;</translation-key> activado no verá la <translation-key id="Dialog">Ventana de diálogo</translation-key> y <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> seleccionará automáticamente la opción <translation-key id="Accept-Only-Essential">Aceptar solo esenciales</translation-key>.','Backend / Settings / HintWith Setup Mode enabled, you can test your setup without having to enable <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>. Only you will see the <translation-key id="Dialog">Dialog</translation-key> on your website.'=>'Con el modo de configuración activado, puedes probar tu configuración sin tener que activar el <translation-key id="Borlabs-Cookie-Status">Estado de Borlabs Cookie</translation-key>. Solo tú verás la <translation-key id="Dialog">Ventana de diálogo</translation-key> en tu sitio web.','Backend / Settings / HintUpdates the version of the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. This will cause the <translation-key id="Dialog">Dialog</translation-key> to reappear for visitors who have already selected an option.'=>'Actualiza la versión de la cookie de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Esto hará que la <translation-key id="Dialog">Ventana de diálogo</translation-key> vuelva a aparecer para los visitantes que ya hayan seleccionado una opción.','Backend / Settings / TextVersion'=>'Versión','Backend / Settings / Things to know / TextWhen you have to aggregate the consent:'=>'Cuándo tienes que agregar el consentimiento:','Backend / Settings / Things to know / Text- if one site is using only the domain (e.g. <strong><em>example.com</em></strong>) and the other site a subdomain (e.g. <strong><em>shop.example.com</em></strong>)'=>'- si un sitio utiliza solo el dominio (por ejemplo, <strong><em>example.com</em></strong>) y el otro sitio un subdominio (por ejemplo, <strong><em>shop.example.com</em></strong>)','Backend / Settings / Things to know / Text- if one site is using the root folder <strong>/</strong> and the other site a subfolder (e.g. <strong>/shop</strong>)'=>'- si un sitio utiliza la carpeta raíz <strong>/</strong> y el otro sitio una subcarpeta (por ejemplo, <strong>/shop</strong>)','Backend / Settings / Things to know / TextWhen you can separate the consent:'=>'Cuándo puedes separar el consentimiento:','Backend / Settings / Things to know / Text- if all sites are using different domains (e.g. <strong><em>example.com</em></strong> and <strong><em>my-example.com</em></strong>) or different subdomains (e.g. <strong><em>www.example.com</em></strong> and <strong><em>shop.example.com</em></strong>)'=>'- si todos los sitios utilizan dominios diferentes (por ejemplo, <strong><em>example.com</em></strong> y <strong><em>my-example.com</em></strong>) o subdominios diferentes (por ejemplo, <strong><em>www.example.com</em></strong> y <strong><em>shop.example.com</em></strong>)','Backend / Settings / Things to know / Text- if all sites are using different subfolders (e.g. <strong>/en</strong> and <strong>/de</strong>)'=>'- si todos los sitios utilizan subcarpetas diferentes (por ejemplo, <strong>/en</strong> y <strong>/de</strong>)','Backend / Settings / Things to know / TextThe visitor\'s consent is transferred to all specified domains and WordPress installations, provided the websites are set up in the same way (<translation-key id="Service">Service</translation-key> and <translation-key id="Service-Group">Service Group</translation-key> IDs must match). Any consent or modification by the visitor will be shared with the specified domains.'=>'El consentimiento del visitante se transfiere a todos los dominios e instalaciones de WordPress especificados, siempre que los sitios web estén configurados del mismo modo (los ID de <translation-key id="Service">Servicio</translation-key> y <translation-key id="Service-Group">Grupo de servicios</translation-key> deben coincidir). Cualquier consentimiento o modificación por parte del visitante se compartirá con los dominios especificados.','Backend / Settings / Things to know / Text<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>More information about <translation-key id="Cross-Cookie-Domains">Cross Cookie Domains</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>'=>'<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Más información sobre la <translation-key id="Cross-Cookie-Domains">Cookie interdominio - Dominios</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>','Backend / Settings / Things to know / HeadlineAggregate Consents'=>'Agregar los consentimientos','Backend / Settings / Things to know / Headline<translation-key id="Cross-Cookie-Domains">Cross Cookie Domains</translation-key>'=>'<translation-key id="Cross-Cookie-Domains">Cookie interdominio - Dominios</translation-key>','Backend / Settings / Things to know / HeadlineWhat is the Cookie Version?'=>'¿Qué es la versión de la cookie?','Backend / Settings / Things to know / HeadlineWhat is the Meta Box?'=>'¿Qué es la meta box?','Backend / Settings / Things to know / TextThe cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> is assigned a version number. It is used to ask the visitor again for their consent if changes have been made to the <translation-key id="Services">Services</translation-key>. If the version number in the cookie differs from the current version number, the <translation-key id="Dialog">Dialog</translation-key> appears to the visitor.'=>'La cookie de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> tiene asignado un número de versión. Se utiliza para volver a pedir al visitante su consentimiento si se han realizado cambios en los <translation-key id="Services">Servicios</translation-key>. Si el número de versión de la cookie difiere del número de versión actual, la <translation-key id="Dialog">Ventana de diálogo</translation-key> se muestra al visitante.','Backend / Settings / Things to know / TextIf active the <translation-key id="Meta-Box">Meta Box</translation-key> is displayed in the selected post types. This allows you to execute code (JavaScript, HTML, <translation-key id="Shortcodes">Shortcodes</translation-key>) on the page and e.g. trigger a conversion pixel.'=>'Si está activa, la <translation-key id="Meta-Box">Meta box</translation-key> se muestra en los tipos de entradas seleccionados. Esto te permite ejecutar código (JavaScript, HTML, <translation-key id="Shortcodes">Shortcodes</translation-key>) en la página y, por ejemplo, activar un píxel de conversión.','Backend / Settings / URLhttps://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis'=>'https://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis','Backend / Style Blocker / BreadcrumbEdit: {{ name }}'=>'Modificar: {{ name }}','Backend / Style Blocker / BreadcrumbStyle Blockers'=>'Bloqueadores de estilo','Backend / Style Blocker / BreadcrumbNew'=>'Nuevo','Backend / Script Blocker / Field LabelContent Blocker Global JavaScript'=>'Bloqueador de contenido Global JavaScript','Backend / Style Blocker / LabelHandles'=>'Handles','Backend / Style Blocker / LabelID'=>'ID','Backend / Style Blocker / LabelName'=>'Nombre','Backend / Style Blocker / LabelPhrases'=>'Frases','Backend / Script Blocker / LabelService Opt-in Script Tag'=>'Etiqueta de script para la aceptación del servicio','Backend / Style Blocker / LabelStatus'=>'Estado','Backend / Style Blocker / HeadlineStyle Blocker Configuration'=>'Configuración del bloqueador de estilo','Backend / Style Blocker / HeadlineStyle Blocker Information'=>'Información sobre el bloqueador de estilo','Backend / Style Blocker / HeadlineStyle Blocker Settings'=>'Ajustes del bloqueador de estilo','Backend / Script Blocker / HintIf your intention is to unblock previously blocked <translation-key id="Styles">Styles</translation-key> upon unblocking a <translation-key id="Content-Blocker">Content Blocker</translation-key>, please insert the provided JavaScript into the <translation-key id="Global">Global</translation-key> field within your <translation-key id="Content-Blocker">Content Blocker</translation-key> settings.'=>'Si tu intención es desbloquear <translation-key id="Styles">Estilos</translation-key> previamente bloqueados al desbloquear un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>, inserta el JavaScript proporcionado en el campo <translation-key id="Global">Global</translation-key> en tus ajustes del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>.','Backend / Style Blocker / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'Debe definirse la <translation-key id="ID">ID</translation-key>. La <translation-key id="ID">ID</translation-key> debe tener al menos 3 caracteres y solo puede contener: <strong><em>a-z - _</em></strong>','Backend / Style Blocker / HintThe name of the <translation-key id="Style-Blocker">Style Blocker</translation-key>.'=>'El nombre del <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>.','Backend / Script Blocker / HintTo allow the unblocking of previously blocked <translation-key id="Styles">Styles</translation-key> through user consent for a <translation-key id="Service">Service</translation-key>, please insert the ensuing script tag into the field labeled <translation-key id="Opt-in-Code">Opt-in Code</translation-key> within your <translation-key id="Service">Service</translation-key>.'=>'Para permitir el desbloqueo de <translation-key id="Styles">Estilos</translation-key> previamente bloqueados mediante el consentimiento del usuario para un <translation-key id="Service">Servicio</translation-key>, inserta la siguiente etiqueta de script en el campo <translation-key id="Opt-in-Code">Código de aceptación</translation-key> en tu <translation-key id="Service">Servicio</translation-key>.','Backend / Style Blocker / HintThe status of this <translation-key id="Style-Blocker">Style Blocker</translation-key>. If the <translation-key id="Style-Blocker">Style Blocker</translation-key> is disabled, it will not block stylesheets and style-tags.'=>'El estado de este <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>. Si el <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key> está desactivado, no bloqueará las hojas ni las etiquetas de estilo.','Backend / Style Blockers / Alert MessageNo <translation-key id="Style-Blocker">Style Blocker</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>.','Backend / Style Blockers / BreadcrumbStyle Blockers'=>'Bloqueadores de estilo','Backend / Style Blockers / HeadlineStyle Blockers'=>'Bloqueadores de estilo','Backend / Style Blockers / Table HeadlineHandles'=>'Handles','Backend / Style Blockers / Table HeadlineID'=>'ID','Backend / Style Blockers / Table HeadlineName'=>'Nombre','Backend / Style Blockers / Table HeadlinePhrases'=>'Frases','Backend / Style Blockers / Table HeadlineStatus'=>'Estado','Backend / Style Blockers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Style-Blockers">Style Blockers</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key>?','Backend / Style Blockers / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Style Blockers / Tip / HeadlineLanguage independent'=>'Independiente del idioma','Backend / Style Blockers / Tip / Text<translation-key id="Style-Blockers">Style Blockers</translation-key> are configured independently for all languages.'=>'Los <translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key> se configuran de forma independiente para todos los idiomas.','Backend / Style Blockers / Things to know / TextThe <translation-key id="Style-Blockers">Style Blockers</translation-key> section allows you to block <translation-key id="CSS">CSS</translation-key> from <translation-key id="Plugins">Plugins</translation-key> that, for example, embed <translation-key id="CSS">CSS</translation-key> to load external fonts like <translation-key id="Google-Fonts">Google Fonts</translation-key>.'=>'La sección <translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key> te permite bloquear <translation-key id="CSS">CSS</translation-key> de <translation-key id="Plugins">Plugins</translation-key> que, por ejemplo, incrustan <translation-key id="CSS">CSS</translation-key> para cargar fuentes externas, como <translation-key id="Google-Fonts">Google Fonts</translation-key>.','Backend / Style Blockers / Things to know / TextOnce a <translation-key id="Style-Blocker">Style Blocker</translation-key> is created, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> provides an unblock JavaScript that can be entered into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>. The <translation-key id="CSS">CSS</translation-key> becomes unblocked once a visitor consents to the <translation-key id="Service">Service</translation-key>.'=>'Una vez creado un <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> proporciona un JavaScript de desbloqueo que puede introducirse en el campo <translation-key id="Opt-in-Code">Código de aceptación</translation-key> de un <translation-key id="Service">Servicio</translation-key>. El <translation-key id="CSS">CSS</translation-key> se desbloquea una vez que el visitante da su consentimiento para el <translation-key id="Service">Servicio</translation-key>.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Style-Blocker">Style Blocker</translation-key> is enabled and actively prevents <translation-key id="CSS">CSS</translation-key> execution if the <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key> matches a term configured in the system.'=>'El <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key> está habilitado e impide activamente la ejecución de <translation-key id="CSS">CSS</translation-key> si los <translation-key id="Handles">Handles</translation-key> o <translation-key id="Phrases">Frases</translation-key> coinciden con un término configurado en el sistema.','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Style-Blocker">Style Blocker</translation-key>. Not available for a <translation-key id="Style-Blocker">Style Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Eliminar el <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>. No disponible para un <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key> instalado a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key>.','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Style-Blocker">Style Blocker</translation-key>.'=>'Modifica el <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key>.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Style-Blocker">Style Blocker</translation-key> is inactive, allowing all <translation-key id="CSS">CSS</translation-key> are executed without filtering or restricting based on <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key>.'=>'El <translation-key id="Style-Blocker">Bloqueador de estilo</translation-key> está inactivo y permite que todos los <translation-key id="CSS">CSS</translation-key> se ejecuten sin filtros o restricciones basados en <translation-key id="Handles">Handles</translation-key> o <translation-key id="Phrases">Frases</translation-key>.','Backend / GeoIp / Alert MessageConnecting to the API failed. Please check that Wordpress has access to the Internet or retry later.'=>'La conexión a la API ha fallado. Comprueba que Wordpress tenga acceso a Internet o vuelve a intentarlo más tarde.','Backend / GeoIp / Alert MessageMoving the database file failed.'=>'El desplazamiento del archivo de la base de datos ha fallado.','Backend / GeoIp / Alert MessagePlease enable GeoIP before downloading the database.'=>'Activa GeoIP antes de descargar la base de datos.','Backend / GeoIp / Alert MessageThe database was successfully updated.'=>'La base de datos se ha actualizado correctamente.','Backend / GeoIp / Alert MessageYou already have the most up-to-date database.'=>'Ya dispones de la base de datos más actualizada.','Backend / GeoIp / Alert MessageUnpacking the database to the temporary folder failed. Please check if the temporary folder is writable and the PHP module ZIP is installed.'=>'La descompresión de la base de datos en la carpeta temporal ha fallado. Comprueba que la carpeta temporal tenga permisos de escritura y el módulo PHP ZIP esté instalado.','Backend / Model Localization / ModelCompatibility Patch'=>'Parche de compatibilidad','Backend / Model Localization / ModelContent Blocker'=>'Bloqueador de contenido','Backend / Model Localization / ModelProvider'=>'Proveedor','Backend / Services / Things to know / Headline<translation-key id="Tracking">Tracking</translation-key> cookies are used to analyze user behavior on the website and to optimize the website based on the results.'=>'Las cookies de <translation-key id="Tracking">Rastreo</translation-key> se utilizan para analizar el comportamiento de los usuarios en el sitio web y para optimizar el sitio web en función de los resultados.','Backend / Services / Things to know / Headline<translation-key id="Type">Type</translation-key>: Choose where information is stored in the browser. <translation-key id="HTTP">HTTP</translation-key> cookies are commonly used, alternatives like <translation-key id="Local-Storage">Local Storage</translation-key> or <translation-key id="Session-Storage">Session Storage</translation-key> do not possess predetermined lifetimes.'=>'<translation-key id="Type">Tipo</translation-key>: elige dónde se almacena la información en el navegador. Las cookies <translation-key id="HTTP">HTTP</translation-key> se utilizan habitualmente, mientras que las alternativas como <translation-key id="Local-Storage">Almacenamiento local</translation-key> o <translation-key id="Session-Storage">Almacenamiento de sesión</translation-key> no tienen una duración predeterminada.','Backend / Services / Alert MessageNo <translation-key id="Service-Group">Service Group</translation-key> selected.'=>'No se ha seleccionado ningún <translation-key id="Service-Group">Grupo de servicios</translation-key>.','Backend / Services / AlertThe selected <translation-key id="Provider">Provider<