ices / HintThis code is executed only if the visitor has previously consented and now chooses to opt out. It is executed once.'=>'Este código solo se ejecuta si el visitante ha dado previamente su consentimiento y ahora opta por el rechazo. Se ejecuta solo una vez.','Backend / Services / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to display an opt-out option for this <translation-key id="Service">Service</translation-key>.'=>'Utiliza este <translation-key id="Shortcode">Shortcode</translation-key> para mostrar una opción de rechazo para este <translation-key id="Service">Servicio</translation-key>.','Backend / Services / HintDetermine the position where this <translation-key id="Service">Service</translation-key> is displayed in its <translation-key id="Service-Group">Service Group</translation-key>. Order follows natural numbers.'=>'Determina la posición en la que se muestra este <translation-key id="Service">Servicio</translation-key> en su <translation-key id="Service-Group">Grupo de servicios</translation-key>. El orden sigue los números naturales.','Backend / Services / HintA <translation-key id="Service">Service</translation-key> must be linked to a <translation-key id="Provider">Provider</translation-key>. You may choose an existing <translation-key id="Provider">Provider</translation-key> or establish a new one. Please note, the option to create a new <translation-key id="Provider">Provider</translation-key> is available exclusively during the <translation-key id="Service">Service</translation-key> creation process within this view.'=>'Un <translation-key id="Service">Servicio</translation-key> debe estar vinculado a un <translation-key id="Provider">Proveedor</translation-key>. Puedes elegir un <translation-key id="Provider">Proveedor</translation-key> existente o crear uno nuevo. Ten en cuenta que la opción de creación de un nuevo <translation-key id="Provider">Proveedor</translation-key> está disponible exclusivamente durante el proceso de creación de un <translation-key id="Service">Servicio</translation-key> en esta vista.','Backend / Services / HintThe <translation-key id="Service-Group">Service Group</translation-key> the <translation-key id="Service">Service</translation-key> is part of.'=>'El <translation-key id="Service-Group">Grupo de servicios</translation-key> del que forma parte el <translation-key id="Service">Servicio</translation-key>.','Backend / Services / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to unblock JavaScript or content when user opted-in for this <translation-key id="Service">Service</translation-key>.'=>'Utiliza este <translation-key id="Shortcode">Shortcode</translation-key> para desbloquear JavaScript o contenidos cuando el usuario haya aceptado este <translation-key id="Service">Servicio</translation-key>.','Backend / Services / HintThe status of this <translation-key id="Service">Service</translation-key>. If enabled it is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'El estado de este <translation-key id="Service">Servicio</translation-key>. Si está activo, se muestra al visitante en la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Services / Input Placeholder...block this...'=>'...bloquear esto...','Backend / Services / Input PlaceholderNever'=>'Nunca','Backend / Services / Table HeadlineLifetime'=>'Duración','Backend / Services / Table HeadlineName'=>'Nombre','Backend / Library / HintThe <translation-key id="Services">Services</translation-key> are included in this package and are necessary for the proper functioning of this package. They are installed when you click the <translation-key id="Button-Install">Install</translation-key> / <translation-key id="Button-Reinstall">Reinstall</translation-key> / <translation-key id="Button-Update">Update</translation-key> button. You can locate them later using the displayed name and key in the <translation-key id="Services">Services</translation-key> view (<translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Services">Services</translation-key>).'=>'Los <translation-key id="Services">Servicios</translation-key> están incluidos en este paquete y son necesarios para su buen funcionamiento. Se instalan cuando haces clic en el botón <translation-key id="Button-Install">Instalar</translation-key> / <translation-key id="Button-Reinstall">Reinstalar</translation-key> / <translation-key id="Button-Update">Actualizar</translation-key>. Puedes localizarlos más tarde utilizando el nombre y la clave mostrados en la vista <translation-key id="Services">Servicios</translation-key> (<translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Services">Servicios</translation-key>).','Backend / Services / Table HeadlinePurpose'=>'Finalidad','Backend / Library / HintThe <translation-key id="Style-Blockers">Style Blockers</translation-key> are included in this package and are necessary for the proper functioning of this package. They are installed when you click the <translation-key id="Button-Install">Install</translation-key> / <translation-key id="Button-Reinstall">Reinstall</translation-key> / <translation-key id="Button-Update">Update</translation-key> button. You can locate them later using the displayed name and key in the <translation-key id="Style-Blockers">Style Blockers</translation-key> view (<translation-key id="Navigation-Blockers">Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Style-Blockers">Style Blockers</translation-key>).'=>'Los <translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key> están incluidos en este paquete y son necesarios para su buen funcionamiento. Se instalan cuando haces clic en el botón <translation-key id="Button-Install">Instalar</translation-key> / <translation-key id="Button-Reinstall">Reinstalar</translation-key> / <translation-key id="Button-Update">Actualizar</translation-key>. Puedes localizarlos más tarde utilizando el nombre y la clave mostrados en la vista <translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key> (<translation-key id="Navigation-Blockers">Bloqueadores</translation-key> &raquo; <translation-key id="Navigation-Blockers-Style-Blockers">Bloqueadores de estilo</translation-key>).','Backend / Services / Table HeadlineType'=>'Tipo','Backend / Library / NavigationAll'=>'Todos','Backend / Services / Things to know / TextIf you enable this option <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> searches and deletes cookies that match the <translation-key id="Name">Name</translation-key> (<translation-key id="Cookies">Cookies</translation-key> &raquo; <translation-key id="Name">Name</translation-key>). You can also use <strong>*</strong> to search for multiple names, e.g. if you enter the Name <strong><em>example_*</em></strong> <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> will search and delete the cookies <strong><em>example_abc</em></strong> and <strong><em>example_xyz</em></strong>.'=>'Si activas esta opción, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> busca y elimina las cookies que coinciden con el <translation-key id="Name">Nombre</translation-key> (<translation-key id="Cookies">Cookies</translation-key> &raquo; <translation-key id="Name">Nombre</translation-key>). También puedes utilizar <strong>*</strong> para buscar varios nombres; por ejemplo, si introduces el nombre <strong><em>ejemplo_*</em></strong>, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> buscará y eliminará las cookies <strong><em>ejemplo_abc</em></strong> y <strong><em>ejemplo_xyz</em></strong>.','Backend / Library / NavigationFilter'=>'Filtro','Backend 