</translation-key>','Backend / Library / Navigation<translation-key id="Script-Blockers">Script Blockers</translation-key>'=>'<translation-key id="Script-Blockers">Bloqueadores de scripts</translation-key>','Backend / Services / Things to know / Headline<translation-key id="Prioritize">Prioritize</translation-key>'=>'<translation-key id="Prioritize">Dar prioridad</translation-key>','Backend / Library / Navigation<translation-key id="Services">Services</translation-key>'=>'<translation-key id="Services">Servicios</translation-key>','Backend / Services / Things to know / HeadlineWhat is the purpose of <translation-key id="Provider">Provider</translation-key> information?'=>'¿Cuál es la finalidad de la información sobre el <translation-key id="Provider">Proveedor</translation-key>?','Backend / Library / Navigation<translation-key id="Style-Blockers">Style Blockers</translation-key>'=>'<translation-key id="Style-Blockers">Bloqueadores de estilo</translation-key>','Backend / Services / Things to know / HeadlineOpt-out Shortcode explained'=>'Explicación del shortcode de rechazo','Backend / Library / Input PlaceholderSearch'=>'Buscar','Backend / Services / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'Explicación del <translation-key id="Shortcode">Shortcode</translation-key>','Backend / Library / Table HeadlineType'=>'Tipo','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> can be used to display an opt-out option for this <translation-key id="Service">Service</translation-key>.'=>'El <translation-key id="Shortcode">Shortcode</translation-key> se puede utilizar para mostrar una opción de rechazo para este <translation-key id="Service">Servicio</translation-key>.','Backend / Library / Table HeadlineName'=>'Nombre','Backend / Services / Things to know / TextThe <translation-key id="Opt-in-Code">Opt-in Code</translation-key> is loaded in <strong><em>&lt;hea