a-Box">Meta Box</translation-key> of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. You can find it for example in <translation-key id="Posts">Posts</translation-key> &raquo; <em><translation-key id="Your-Post">Your Post</translation-key></em> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> &raquo; <translation-key id="Custom-Code">Custom Code</translation-key>.'=>'El <translation-key id="Shortcode">Shortcode</translation-key> puede utilizarse, por ejemplo, en la <translation-key id="Meta-Box">Meta box</translation-key> de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Puedes encontrarlo, por ejemplo, en <translation-key id="Posts">Entradas</translation-key> &raquo; <em><translation-key id="Your-Post">Tu entrada</translation-key></em> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> &raquo; <translation-key id="Custom-Code">Código personalizado</translation-key>.','Backend / License / Alert MessageYour license request is not valid.'=>'Tu solicitud de licencia no es válida.','Backend / Services / Things to know / TextThe <translation-key id="Shortcodes">Shortcodes</translation-key> are not available until the <translation-key id="Service">Service</translation-key> is created.'=>'Los <translation-key id="Shortcodes">Shortcodes</translation-key> no están disponibles hasta que se crea el <translation-key id="Service">Servicio</translation-key>.','Backend / Services / LabelAsynchronous Opt-out Code'=>'Código de rechazo asíncrono','Backend / Services / LabelBlock Cookies Before Consent'=>'Bloquear las cookies antes del consentimiento','Backend / Services / Label<translation-key id="Prioritize">Prioritize</translation-key>'=>'<translation-key id="Prioritize">Dar prioridad</translation-key>','Backend / Services / HintThe <translation-key id="Opt-out-Code">Opt-out Code</translation-key> contains asynchronous JavaScript code that needs to executed to finish the Opt-out.'=>'El <translation-key id="Opt-out-Code">Código de rechazo</translation-key> contiene código JavaScript asíncrono que debe ejecutarse para finalizar el rechazo.','Backend / Services / HintIf enabled, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> tries to block cookies with the names from <translation-key id="Cookie-Name">Cookie Name</translation-key> until consent is given.'=>'Si está activado, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> intenta bloquear las cookies con los nombres de <translation-key id="Cookie-Name">Nombre de cookie</translation-key> hasta que se dé el consentimiento.','Backend / License / Alert MessageLicense information refreshed successfully.'=>'La información sobre la licencia se ha actualizado correctamente.','Backend / Services / HintThe <translation-key id="Opt-in-Code">Opt-in Code</translation-key> is loaded in <strong><em>&lt;head&gt;</em></strong> and is executed before the page is fully loaded.'=>'El <translation-key id="Opt-in-Code">Código de aceptación</translation-key> se carga en <strong><em>&lt;head&gt;</em></strong> y se ejecuta antes de que la página se cargue por completo.','Backend / License / Alert MessageLicense registered successfully.'=>'Licencia registrada correctamente.','Backend / Service Location / Alert MessageNo <translation-key id="Location">Location</translation-key> configured.'=>'No se ha configurado ninguna <translation-key id="Location">Dirección</translation-key>.','Backend / License / Alert MessageLicense removed successfully.'=>'Licencia eliminada correctamente.','Backend / Service Location / ButtonAdd Location'=>'Añadir una dirección','Backend / Service Location / LabelHostname'=>'Nombre de host','Backend / License / BreadcrumbLicense'=>'Licencia','Backend / Service Location / LabelPath'=>'Ruta','Backend / License / Button TitleRefresh License Information'=>'Actualizar la información sobre la licencia','Backend / Service Location / Headline<