s established. Therefore, it is advisable to record this domain here and thus name the service responsible for it, so that interested visitors can understand why this external connection occurs.'=>'Puede ocurrir que un <translation-key id="Service">Servicio</translation-key> incorporado en tu sitio web no instale una cookie, pero se establezca una conexión con un dominio externo. Por lo tanto, es aconsejable registrar este dominio aquí y dar un nombre al servicio responsable, de modo que los visitantes interesados puedan comprender el motivo de esta conexión externa.','Backend / License / LabelValid Until'=>'Válida hasta','Backend / Service Option / Alert MessageNo <translation-key id="Option">Option</translation-key> configured.'=>'No se ha configurado ninguna<translation-key id="Option">Opción</translation-key>.','Backend / License / LabelMax Websites'=>'Número máximo de sitios web','Backend / Service Option / ButtonAdd Option'=>'Añadir una opción','Backend / License / LabelRefresh'=>'Actualizar','Backend / Service Option / LabelDescription'=>'Descripción','Backend / License / Headline<translation-key id="Remove-License">Remove License</translation-key>'=>'<translation-key id="Remove-License">Eliminar la licencia</translation-key>','Backend / Service Option / Headline<translation-key id="Options">Options</translation-key>'=>'<translation-key id="Options">Opciones</translation-key>','Backend / License / HeadlineYour License'=>'Tu licencia','Backend / Service Option / Table HeadlineDescription'=>'Descripción','Backend / License / HeadlineYour License Information'=>'Información sobre tu licencia','Backend / Service Option / Table Headline<translation-key id="Type">Type</translation-key>'=>'<translation-key id="Type">Tipo</translation-key>','Backend / License / HintEnter your License Key.'=>'Introduce tu clave de licencia.','Backend / Service Option / Things to know / HeadlineWhat is the purpose of the <translation-key id="Options">Options</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Options">Opciones</translation-key>?','Backend / License / HintPlease confirm that you want to remove your license data from this website. After the license data is removed you are able to enter your new license key.'=>'Confirma que deseas eliminar tus datos de licencia de este sitio web. Una vez eliminados los datos de licencia, podrás introducir tu nueva clave de licencia.','Backend / Service Option / Things to know / TextWith <translation-key id="Options">Options</translation-key> you can provide more information about the <translation-key id="Service">Service</translation-key>. There are six <translation-key id="Types">Types</translation-key> to choose from and you can add as many <translation-key id="Options">Options</translation-key> as you like.'=>'Con las <translation-key id="Options">Opciones</translation-key> puedes proporcionar más información sobre el <translation-key id="Service">Servicio</translation-key>. Puedes elegir entre seis <translation-key id="Types">Tipos</translation-key> y añadir tantas <translation-key id="Options">Opciones</translation-key> como desees.','Backend / License / TextYour license has expired.'=>'Tu licencia ha expirado.','Backend / Service Option / Things to know / TextFor example, you could select the &quot;<translation-key id="Location-Processing">Location Processing</translation-key>&quot; <translation-key id="Type">Type</translation-key> and add <strong>United States of America</strong> as description if the <translation-key id="Service">Service</translation-key> processes data in the United States.'=>'Por ejemplo, puedes seleccionar el <translation-key id="Type">Tipo</translation-key> &quot;<translation-key id="Location-Processing">Lugar de tratamiento</translation-key>&quot; y añadir <strong>Estados Unidos de América</strong> como descripción si el <translation-key id="Service">Servicio</translation-key> trata datos en los Estados Unidos.','Backend / License / TextYour license is valid.'=>'Tu licencia es válida.','Backend / Services / Alert MessageNo <translation-key id="Service">Service</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Service">Servicio</translation-key>.','Backend / License / Things to know / HeadlineTransferring a license key to a new website'=>'Transferencia de una clave de licencia a un nuevo sitio web','Backend / License / Things to know / TextYou can use the <translation-key id="Remove-License">Remove License</translation-key> option to remove the license from this website, or you can visit our <translation-key id="Customer-Portal">Customer Portal</translation-key> and remove the license from there.'=>'Puedes utilizar la opción <translation-key id="Remove-License">Eliminar la licencia</translation-key> para eliminar la licencia de este sitio web o puedes visitar nuestro <translation-key id="Customer-Portal">Portal de clientes</translation-key> y eliminar la licencia desde allí.','Backend / License / Things to know / Text<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span><translation-key id="Customer-Portal">Customer Portal</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>'=>'<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span><translation-key id="Customer-Portal">Portal de clientes</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>','Backend / Local Scanner / TextAn error has occurred. Please check your browser\'s console for an error message. If the issue persists even after trying again and switching to <translation-key id="Scan-Mode">Scan Mode</translation-key>: <translation-key id="Manual">Manual</translation-key>, kindly reach out to our support team for assistance.'=>'Se ha producido un error. Comprueba si hay un mensaje de error en la consola de tu navegador. Si el problema persiste incluso después de intentarlo de nuevo y cambiar al <translation-key id="Scan-Mode">Modo de escaneo</translation-key>: <translation-key id="Manual">Manual</translation-key>, ponte en contacto con nuestro equipo de asistencia técnica para obtener ayuda.','Backend / Services / HeadlineReset Default Services'=>'Restablecer los servicios predeterminados','Backend / Local Scanner / ButtonRun scan'=>'Ejecutar escaneo','Backend / Services / HintPlease confirm that you want to reset all <translation-key id="Service">Service</translation-key> settings. They will be reset to their default settings. Your custom <translation-key id="Services">Services</translation-key> and the <translation-key id="Services">Services</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key> are not reset.'=>'Confirma que deseas restablecer todos los ajustes del <translation-key id="Service">Servicio</translation-key>. Se restablecerán los ajustes predeterminados. Tus <translation-key id="Services">Servicios</translation-key> personalizados y los <translation-key id="Services">Servicios</translation-key> instalados a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key> no se restablecerán.','Backend / Local Scanner / LabelPage to scan'=>'Página por escanear','Backend / Services / Table HeadlineID'=>'ID','Backend / Local Scanner / Label<translation-key id="Scan-Mode">Scan Mode</translation-key>'=>'<translation-key id="Scan-Mode">Modo de escaneo</translation-key>','Backend / Services / Table HeadlinePosition'=>'Posición','Backend / Local Scanner / Label<translation-key id="Search-Phrase">Search Phrase</translation-key>'=>'<translation-key id="Search-Phrase">Frase de búsqueda</translation-key>','Backend / Services / Table HeadlineStatus'=>'Estado','Backend / Local Scanner / HeadlineScan Progress'=>'Progreso del escaneo','Backend / Services / Things to know / HeadlineWhat is the purpose of the <translation-key id="Services">Services</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Services">Servicios</translation-key>?','Backend / Local Scanner / HeadlineScan Settings'=>'Ajustes de escaneo','Backend / Services / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Local Scanner / HintThe string <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> is looking for. Separate multiple entries with a comma.'=>'La cadena de caracteres que busca <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Separa las entradas múltiples con una coma.','Backend / Services / Things to know / TextIn the <translation-key id="Services">Services</translation-key> section you can document the use of services and their cookies for your visitors, as well as integrate JavaScripts, such as Google Analytics.'=>'En la sección <translation-key id="Services">Servicios</translation-key>, puedes documentar el uso de servicios y sus cookies por parte de tus visitantes, así como integrar JavaScripts, como Google Analytics.','Backend / Services / Things to know / TextBecause <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> uses the opt-in process, JavaScripts are only executed after the visitor has given their consent to the <translation-key id="Service-Group">Service Group</translation-key> or <translation-key id="Service">Service</translation-key>.'=>'Dado que <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> utiliza el proceso de aceptación, los JavaScripts solo se ejecutan después de que el visitante haya dado su consentimiento para el <translation-key id="Service-Group">Grupo de servicios</translation-key> o el <translation-key id="Service">Servicio</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Scan-Modes">Scan Modes</translation-key>'=>'<translation-key id="Scan-Modes">Modos de escaneo</translation-key>','Backend / Services / Things to know / TextThe <translation-key id="Service">Service</translation-key> is active and displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'El <translation-key id="Service">Servicio</translation-key> está activo y se muestra en la <translation-key id="Dialog">Ventana de diálogo</translation-key>. No disponible para el <translation-key id="Service">Servicio</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Current-User">Current User</translation-key>:<br>The scan is performed as the currently logged in user. This may affect the results if the user has different rights than a guest user.'=>'<translation-key id="Current-User">Usuario actual</translation-key>:<br>el escaneo se realiza como el usuario actualmente conectado. Esto puede afectar a los resultados si el usuario tiene derechos diferentes de los de un usuario invitado.','Backend / Services / Things to know / TextDelete the <translation-key id="Service">Service</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Eliminar el <translation-key id="Service">Servicio</translation-key>. No disponible para el <translation-key id="Service">Servicio</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / HeadlineFor example: Some plugins do not embed tracking JavaScript for users with the role of an administrator.'=>'Por ejemplo: algunos plugins no incorporan JavaScript de rastreo para usuarios con función de administrador.','Backend / Services / Things to know / TextEdit the <translation-key id="Service">Service</translation-key>.'=>'Modificar el <translation-key id="Service">Servicio</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Guest">Guest</translation-key>:<br>The scan is performed as a guest user. This is the default setting.'=>'<translation-key id="Guest">Invitado</translation-key>:<br>el escaneo se realiza como usuario invitado. Este es el ajuste predeterminado.','Backend / Services / Things to know / TextThe <translation-key id="Service">Service</translation-key> is inactive and not displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'El <translation-key id="Service">Servicio</translation-key> está inactivo y no se muestra en la <translation-key id="Dialog">Ventana de diálogo</translation-key>. No disponible para el <translation-key id="Service">Servicio</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Manual">Manual</translation-key>:<br>When you use this mode, a signed URL is provided that you can use to run the scan by clicking on it. This is useful if the scan cannot be performed due to a server configuration or if your website is not accessible from the outside (<translation-key id="Local-Environment">Local Environment</translation-key> or <translation-key id="Staging-Environment">Staging Environment</translation-key>), for example.'=>'<translation-key id="Manual">Manual</translation-key>:<br>cuando utilizas este modo, se proporciona una URL firmada que puedes utilizar para ejecutar el escaneo haciendo clic en ella. Esto es útil si el escaneo no puede realizarse debido a una configuración del servidor o si tu sitio web no es accesible desde el exterior (<translation-key id="Local-Environment">Entorno local</translation-key> o <translation-key id="Staging-Environment">Entorno de ensayo</translation-key>), por ejemplo.','Backend / Service Group / BreadcrumbEdit: {{ name }}'=>'Modificar: {{ name }}','Backend / Local Scanner / Alert MessageNo scan result available.'=>'No hay resultados de escaneo disponibles.','Backend / Service Group / BreadcrumbService Groups'=>'Grupos de servicios','Backend / Local Scanner / Headline<translation-key id="Matched-Handles">Matched Handles</translation-key>'=>'<translation-key id="Matched-Handles">Handles coincidentes</translation-key>','Backend / Service Group / BreadcrumbNew'=>'Nuevo','Backend / Local Scanner / Headline<translation-key id="Matched-Tags">Matched Tags</translation-key>'=>'<translation-key id="Matched-Tags">Etiquetas coincidentes</translation-key>','Backend / Service Groups / LabelDescription'=>'Descripción','Backend / Local Scanner / Headline<translation-key id="Unmatched-Handles">Unmatched Handles</translation-key>'=>'<translation-key id="Unmatched-Handles">Handles no coincidentes</translation-key>','Backend / Service Groups / LabelID'=>'ID','Backend / Local Scanner / Headline<translation-key id="Unmatched-Tags">Unmatched Tags</translation-key>'=>'<translation-key id="Unmatched-Tags">Etiquetas no coincidentes</translation-key>','Backend / Service Groups / LabelName'=>'Nombre','Backend / Local Scanner / HintSpecifies the name of the object that must be present for the script from the <strong>Tag</strong> column to be executed. Allowed characters include $, _, letters (both upper and lower case), and numbers. The first character must be $, _, or a letter, while subsequent characters can also include numbers.'=>'Especifica el nombre del objeto que debe estar presente para que se ejecute el script de la columna <strong>Etiqueta</strong>. Los caracteres permitidos son $, _, letras (mayúsculas y minúsculas) y números. El primer carácter debe ser $, _ o una letra, mientras que los caracteres siguientes también pueden incluir números.','Backend / Service Groups / LabelPosition'=>'Posición','Backend / Local Scanner / HintEnter a unique string found in the <strong>Tag</strong> to block the script. It should be unique enough that it is not found in other JavaScripts as well.'=>'Introduce una cadena de caracteres única encontrada en la <strong>Etiqueta</strong> para bloquear el script. Debe ser lo suficientemente única como para que no se encuentre también en otros JavaScripts.','Backend / Service Groups / LabelPre-selected'=>'Preseleccionado','Backend / Local Scanner / Table HeadlineBlock'=>'Bloquear','Backend / Service Groups / Label<translation-key id="Shortcode">Shortcode</translation-key>'=>'<translation-key id="Shortcode">Shortcode</translation-key>','Backend / Local Scanner / Table Headline<translation-key id="Handle">Handle</translation-key>'=>'<translation-key id="Handle">Handle</translation-key>','Backend / Service Groups / LabelStatus'=>'Estado','Backend / Local Scanner / Table Headline<translation-key id="onExist">onExist</translation-key>'=>'<translation-key id="onExist">onExist</translation-key>','Backend / Service Groups / HeadlineService Group Information'=>'Información sobre el grupo de servicios','Backend / Local Scanner / Table Headline<translation-key id="Phrase">Phrase</translation-key>'=>'<translation-key id="Phrase">Frase</translation-key>','Backend / Service Groups / HeadlineService Group Settings'=>'Ajustes del grupo de servicios','Backend / Local Scanner / Table HeadlineTag'=>'Etiqueta','Backend / Service Groups / HintEnter a description for this <translation-key id="Service-Group">Service Group</translation-key>. It is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Introduce una descripción para este <translation-key id="Service-Group">Grupo de servicios</translation-key>. Se muestra al visitante en la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Local Scanner / Table HeadlineType'=>'Tipo','Backend / Service Groups / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'Debe definirse la <translation-key id="ID">ID</translation-key>. La <translation-key id="ID">ID</translation-key> debe tener al menos 3 caracteres y solo puede contener: <strong><em>a-z - _</em></strong>','Backend / Local Scanner / Table HeadlineURL'=>'URL','Backend / Service Groups / HintChoose a name for this <translation-key id="Service-Group">Service Group</translation-key>. It is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Elige un nombre para este <translation-key id="Service-Group">Grupo de servicios</translation-key>. Se muestra al visitante en la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> are used to identify the JavaScript files that are loaded on your website. For example, your installed <translation-key id="Themes">Themes</translation-key> and <translation-key id="Plugins">Plugins</translation-key> use the WordPress function <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_script/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_script()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> to define the <translation-key id="Handles">Handles</translation-key>.'=>'Los <translation-key id="Handles">Handles</translation-key> se utilizan para identificar los archivos JavaScript cargados en tu sitio web. Por ejemplo, tus <translation-key id="Themes">Temas</translation-key> y <translation-key id="Plugins">Plugins</translation-key> instalados utilizan la función de WordPress <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_script/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_script()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> para definir los <translation-key id="Handles">Handles</translation-key>.','Backend / Service Groups / HintDetermine the position where this <translation-key id="Service-Group">Service Group</translation-key> is displayed. Order follows natural numbers.'=>'Determina la posición en la que se muestra este <translation-key id="Service-Group">Grupo de servicios</translation-key>. El orden sigue los números naturales.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> are used to identify the <translation-key id="CSS">CSS</translation-key> files that are loaded on your website. For example, your installed <translation-key id="Themes">Themes</translation-key> and <translation-key id="Plugins">Plugins</translation-key> use the WordPress function <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_style/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_style()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> to define the <translation-key id="Handles">Handles</translation-key>.'=>'Los <translation-key id="Handles">Handles</translation-key> se utilizan para identificar los archivos <translation-key id="CSS">CSS</translation-key> cargados en tu sitio web. Por ejemplo, tus <translation-key id="Themes">Temas</translation-key> y <translation-key id="Plugins">Plugins</translation-key> instalados utilizan la función de WordPress <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_style/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_style()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> para definir los <translation-key id="Handles">Handles</translation-key>.','Backend / Service Groups / HintIf enabled, this <translation-key id="Service-Group">Service Group</translation-key> is pre-selected in the <translation-key id="Dialog">Dialog</translation-key>. The visitor can de-select it.'=>'Si está activado, este <translation-key id="Service-Group">Grupo de servicios</translation-key> se preselecciona en la <translation-key id="Dialog">Ventana de diálogo</translation-key>. El visitante puede deseleccionarlo.','Backend / Local Scanner / Headline<translation-key id="Matched-Handles">Matched Handles</translation-key>:<br>These are <translation-key id="Handles">Handles</translation-key> that matches your <translation-key id="Search-Phrase">Search Phrase</translation-key>.'=>'<translation-key id="Matched-Handles">Handles coincidentes</translation-key>:<br>son los <translation-key id="Handles">Handles</translation-key> que coinciden con tu <translation-key id="Search-Phrase">Frase de búsqueda</translation-key>.','Backend / Service Groups / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to unblock JavaScript or content when user opted-in for this <translation-key id="Service-Group">Service Group</translation-key>.'=>'Utiliza este <translation-key id="Shortcode">Shortcode</translation-key> para desbloquear JavaScript o contenidos cuando el usuario ha aceptado este <translation-key id="Service-Group">Grupo de servicios</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Unmatched-Handles">Unmatched Handles</translation-key>:<br>These are <translation-key id="Handles">Handles</translation-key> that do not match a <translation-key id="Search-Phrase">Search Phrase</translation-key> but were found during the scan and maybe relevant.'=>'<translation-key id="Unmatched-Handles">Handles no coincidentes</translation-key>:<br>son los <translation-key id="Handles">Handles</translation-key> que no coinciden con una <translation-key id="Search-Phrase">Frase de búsqueda</translation-key>, pero que se han encontrado durante el escaneo y pueden ser relevantes.','Backend / Service Groups / HintThe status of this <translation-key id="Service-Group">Service Group</translation-key>. If enabled it is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'El estado de este <translation-key id="Service-Group">Grupo de servicios</translation-key>. Si está activado, se muestra al visitante en la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> explained'=>'Explicación de los <translation-key id="Handles">Handles</translation-key> ','Backend / Service Groups / Input Placeholder...block this...'=>'...bloquear esto...','Backend / Local Scanner / Things to know / HeadlineInput fields explained'=>'Explicación de los campos de entrada','Backend / Service Groups / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'Explicación del <translation-key id="Shortcode">Shortcode</translation-key>','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> explained'=>'Explicación de las <translation-key id="Tags">Etiquetas</translation-key>','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> can be used to execute custom code once the visitor has given consent to a <translation-key id="Service">Service</translation-key> associated with this type of <translation-key id="Service-Group">Service Group</translation-key>. This can be used, for example, to block a conversion pixel code.'=>'El <translation-key id="Shortcode">Shortcode</translation-key> puede utilizarse para ejecutar un código personalizado una vez que el visitante haya dado su consentimiento para un <translation-key id="Service">Servicio</translation-key> asociado a este tipo de <translation-key id="Service-Group">Grupo de servicios</translation-key>. Puede utilizarse, por ejemplo, para bloquear el código de un píxel de conversión.','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> refer to <strong><em>&lt;script&gt;</em></strong> tags that lack an associated <translation-key id="Handle">Handle</translation-key>, which can occur when JavaScript is embedded directly into your website\'s HTML code, bypassing the dedicated WordPress function typically used for this purpose'=>'Las <translation-key id="Tags">Etiquetas</translation-key> se refieren a las etiquetas <strong><em>&lt;script&gt;</em></strong> que no tienen ningún <translation-key id="Handle">Handle</translation-key> asociado, lo cual puede ocurrir cuando JavaScript está incorporado directamente en el código HTML de tu sitio web, evitando la función específica de WordPress que se utiliza normalmente para este fin.','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> refer to <strong><em>&lt;link&gt;</em></strong> tags and <strong><em>&lt;style&gt;</em></strong> tags that lack an associated <translation-key id="Handle">Handle</translation-key>, which can occur when <translation-key id="CSS">CSS</translation-key> is embedded directly into your website\'s HTML code, bypassing the dedicated WordPress function typically used for this purpose'=>'Las <translation-key id="Tags">Etiquetas</translation-key> se refieren a las etiquetas <strong><em>&lt;link&gt;</em></strong> y <strong><em>&lt;style&gt;</em></strong> que no tienen ningún <translation-key id="Handle">Handle</translation-key> asociado, lo cual puede ocurrir cuando el <translation-key id="CSS">CSS</translation-key> está incorporado directamente en el código HTML de tu sitio web, evitando la función específica de WordPress que se utiliza normalmente para este fin.','Backend / Local Scanner / Headline<translation-key id="Matched-Tags">Matched Tags</translation-key>:<br>These are <translation-key id="Tags">Tags</translation-key> that matches your <translation-key id="Search-Phrase">Search Phrase</translation-key>.'=>'<translation-key id="Matched-Tags">Etiquetas coincidentes</translation-key>:<br>son las <translation-key id="Tags">Etiquetas</translation-key> que coinciden con tu <translation-key id="Search-Phrase">Frase de búsqueda</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Unmatched-Tags">Unmatched Tags</translation-key>:<br>These are <translation-key id="Tags">Tags</translation-key> that do not match a <translation-key id="Search-Phrase">Search Phrase</translation-key> but were found during the scan and maybe relevant.'=>'<translation-key id="Unmatched-Tags">Etiquetas no coincidentes</translation-key>:<br>son las <translation-key id="Tags">Etiquetas</translation-key> que no coinciden con una <translation-key id="Search-Phrase">Frase de búsqueda</translation-key>, pero que se han encontrado durante el escaneo y pueden ser relevantes.','Backend / Local Scanner / Headline<translation-key id="Phrase">Phrase</translation-key>:<br>Enter a unique string found in the <strong>Tag</strong> to block the script. It should be unique enough that it is not found in other JavaScripts as well.'=>'<translation-key id="Phrase">Frase</translation-key>:<br>introduce una cadena de caracteres única encontrada en la <strong>Etiqueta</strong> para bloquear el script. Debe ser lo suficientemente única como para que no se encuentre también en otros JavaScripts.','Backend / Local Scanner / Headline<translation-key id="onExist">onExist</translation-key>:<br>This feature is optional and ensures that once the JavaScript is unblocked, it does not execute until the object specified in the <translation-key id="onExist">onExist</translation-key> column is present on the website. This capability facilitates the resolution of race condition issues.'=>'<translation-key id="onExist">onExist</translation-key>:<br>esta función es opcional y garantiza que, una vez desbloqueado, el código JavaScript no se ejecute hasta que el objeto especificado en la columna <translation-key id="onExist">onExist</translation-key> esté presente en el sitio web. Esta funcionalidad facilita la resolución de problemas de condición de carrera.','Backend / Local Scanner / HeadlineSpecifies the name of the object that must be present for the script from the <strong>Tag</strong> column to be executed. Allowed characters include $, _, letters (both upper and lower case), and numbers. The first character must be $, _, or a letter, while subsequent characters can also include numbers.'=>'Especifica el nombre del objeto que debe estar presente para que se ejecute el script de la columna <strong>Etiqueta</strong>. Los caracteres permitidos son $, _, letras (mayúsculas y minúsculas) y números. El primer carácter debe ser $, _ o una letra, mientras que los caracteres siguientes también pueden incluir números.','Backend / Local Scanner / HeadlineExample:'=>'Ejemplo:','Backend / Local Scanner / HeadlineThe example initiates loading an external library and concurrently calls the <strong><em>calendarLibrary.init()</em></strong> function. This could induce a race condition issue since, when <strong><em>calendarLibrary.init()</em></strong> is invoked, the <strong><em>calendar-library.js</em></strong> library—responsible for providing this method—might not yet be fully loaded.'=>'El ejemplo inicia la carga de una biblioteca externa y llama simultáneamente la función <strong><em>calendarLibrary.init()</em></strong>. Esto podría provocar un problema de condición de carrera, ya que, cuando se llama la función <strong><em>calendarLibrary.init()</em></strong>, la biblioteca <strong><em>calendar-library.js</em></strong>, responsable de proporcionar este método, podría no estar aún completamente cargada.','Backend / Local Scanner / HeadlineTo mitigate this race condition, block both the script tag that loads the <strong><em>calendar-library.js</em></strong> library and the script tag that calls <strong><em>calendarLibrary.init()</em></strong>. For the script tag where <strong><em>calendarLibrary.init()</em></strong> is called, enter <strong><em>calendarLibrary</em></strong> in the <translation-key id="onExist">onExist</translation-key> field.'=>'Para mitigar esta condición de carrera, bloquea tanto la etiqueta de script que carga la biblioteca <strong><em>calendar-library.js</em></strong> como la etiqueta de script que llama <strong><em>calendarLibrary.init()</em></strong>. Para la etiqueta de script en la que se llama <strong><em>calendarLibrary.init()</em></strong>, introduce <strong><em>calendarLibrary</em></strong> en el campo <translation-key id="onExist">onExist</translation-key>.','Backend / Local Scanner / HeadlineIf the <translation-key id="Script-Blocker">Script Blocker</translation-key> is now unblocked, the script-tag containing <strong><em>calendarLibrary.init()</em></strong> will not execute until the <strong><em>calendar-library.js</em></strong> has completely loaded.'=>'Si el <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key> está desbloqueado, la etiqueta de script que contiene <strong><em>calendarLibrary.init()</em></strong> no se ejecutará hasta que <strong><em>calendar-library.js</em></strong> se haya cargado completamente.','Backend / Local Scanner / Headline<translation-key id="Phrase">Phrase</translation-key>:<br>Enter a unique string found in the <strong>Tag</strong> to block the <translation-key id="CSS">CSS</translation-key>. It should be unique enough that it is not found in other <strong><em>&lt;link&gt;</em></strong> tags or <strong><em>&lt;style&gt;</em></strong> tags as well.'=>'<translation-key id="Phrase">Frase</translation-key>:<br>introduce una cadena de caracteres única encontrada en la <strong>Etiqueta</strong> para bloquear el <translation-key id="CSS">CSS</translation-key>. Debe ser lo suficientemente única como para que no se encuentre también en otras etiquetas <strong><em>&lt;link&gt;</em></strong> o <strong><em>&lt;style&gt;</em></strong>.','Backend / Local Scanner / ValidationThe phrase is not found in the JavaScript code on the left side.'=>'La frase no se encuentra en el código JavaScript de la izquierda.','Backend / Local Scanner / ValidationThe phrase is not unique and overlaps with a phrase for another JavaScript.'=>'La frase no es única y se solapa con una frase para otro JavaScript.','Backend / Log / Alert MessageThe <translation-key id="Log">Log</translation-key> could not be found.'=>'No se ha podido encontrar el <translation-key id="Log">Registro</translation-key>.','Backend / Log / Breadcrumb<translation-key id="Logs">Logs</translation-key>'=>'<translation-key id="Logs">Registros</translation-key>','Backend / Log / BreadcrumbDetails'=>'Detalles','Backend / Log / HeadlineProcess History'=>'Historial del proceso','Backend / Log / FieldBacktrace'=>'Backtrace','Backend / Log / FieldContext'=>'Contexto','Backend / Log / FieldLevel'=>'Nivel','Backend / Log / FieldMessage'=>'Mensaje','Backend / Log / FieldProcess ID'=>'ID del proceso','Backend / Log / Alert MessageNo <translation-key id="Logs">Logs</translation-key> found.'=>'No se han encontrado <translation-key id="Logs">Registros</translation-key>.','Backend / Log / Headline<translation-key id="Logs">Logs</translation-key>'=>'<translation-key id="Logs">Registros</translation-key>','Backend / Log / PlaceholderSearch Process ID, Level or Message'=>'Buscar ID de proceso, nivel o mensaje','Backend / Log / Table HeadlineHas backtrace'=>'Tiene backtrace','Backend / Log / Table HeadlineHas context'=>'Tiene contexto','Backend / Log / Table HeadlineCreated at'=>'Creado el','Backend / Log / Table HeadlineLevel'=>'Nivel','Backend / Log / Table HeadlineMessage'=>'Mensaje','Backend / Log / Table HeadlineProcess ID'=>'ID del proceso','Backend / MetaBox / Field<translation-key id="Custom-Code">Custom Code</translation-key>'=>'<translation-key id="Custom-Code">Código personalizado</translation-key>','Backend / MetaBox / HeadlineBorlabs Cookie - Meta Box'=>'Borlabs Cookie - Meta box','Backend / MetaBox / HintThe code you enter here will only run on this page. Extend your code by wrapping it with our blocking <translation-key id="Shortcodes">Shortcodes</translation-key> to ensure that it only executes after you\'ve received consent. This functionality proves useful in scenarios such as needing to trigger a conversion pixel exclusively on this page.'=>'El código que introduzcas aquí solo se ejecutará en esta página. Amplía tu código envolviéndolo con nuestros <translation-key id="Shortcodes">Shortcodes</translation-key> de bloqueo para garantizar que solo se ejecute después de haber recibido el consentimiento. Esta funcionalidad resulta útil en situaciones como la necesidad de activar un píxel de conversión exclusivamente en esta página.','Backend / Providers / BreadcrumbEdit: {{ name }}'=>'Modificar: {{ name }}','Backend / Providers / BreadcrumbProviders'=>'Proveedores','Backend / Providers / BreadcrumbNew'=>'Nuevo','Backend / Providers / LabelAddress'=>'Dirección','Backend / Providers / LabelCookie URL'=>'URL de la cookie','Backend / Providers / LabelDescription'=>'Descripción','Backend / Providers / Label<translation-key id="IAB-Vendor-ID">IAB Vendor ID</translation-key>'=>'<translation-key id="IAB-Vendor-ID">ID del vendedor IAB</translation-key>','Backend / Providers / LabelID'=>'ID','Backend / Providers / LabelName'=>'Nombre','Backend / Providers / LabelOpt-out URL'=>'URL de rechazo','Backend / Providers / LabelPartners'=>'Socios','Backend / Providers / Label<translation-key id="Privacy-Url">Privacy URL</translation-key>'=>'<translation-key id="Privacy-Url">URL de privacidad</translation-key>','Backend / Providers / HeadlineProvider Information'=>'Información sobre el proveedor','Backend / Providers / LabelYou can optionally provide the <translation-key id="IAB-Vendor-ID">IAB Vendor ID</translation-key> to add information about an IAB Vendor that is not part of the IAB TCF standard.'=>'Opcionalmente, puedes proporcionar la <translation-key id="IAB-Vendor-ID">ID del vendedor IAB</translation-key> para añadir información sobre un vendedor IAB que no forme parte de la norma TCF de IAB.','Backend / Providers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Providers">Providers</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Providers">Proveedores</translation-key>?','Backend / Providers / Things to know / TextFor legal compliance, every <translation-key id="Service">Service</translation-key> or <translation-key id="Content-Blocker">Content Blocker</translation-key> must be linked to a specific <translation-key id="Provider">Provider</translation-key>.'=>'Por motivos de conformidad legal, cada <translation-key id="Service">Servicio</translation-key> o <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> debe estar vinculado a un <translation-key id="Provider">Proveedor</translation-key> específico.','Backend / Providers / Things to know / TextThe <translation-key id="Provider">Provider</translation-key> is the company that delivers the <translation-key id="Service">Service</translation-key> (e.g., Google Analytics) or the content (e.g., YouTube videos).'=>'El <translation-key id="Provider">Proveedor</translation-key> es la empresa que presta el <translation-key id="Service">Servicio</translation-key> (por ejemplo, Google Analytics) o el contenido (por ejemplo, vídeos de YouTube).','Backend / Providers / Things to know / TextVisitors should receive clear information about the <translation-key id="Provider">Provider</translation-key> responsible for the <translation-key id="Service">Service</translation-key> or blocked content.'=>'Los visitantes deben recibir información clara sobre el <translation-key id="Provider">Proveedor</translation-key> responsable del <translation-key id="Service">Servicio</translation-key> o del contenido bloqueado.','Backend / Providers / Alert MessageNo <translation-key id="Provider">Provider</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Provider">Proveedor</translation-key>.','Backend / Providers / HeadlineProviders'=>'Proveedores','Backend / Providers / HeadlineReset Default Providers'=>'Restablecer los proveedores predeterminados','Backend / Providers / HintPlease confirm that you want to reset the <translation-key id="Providers">Providers</translation-key>. They will be reset to their default settings. Your custom <translation-key id="Providers">Providers</translation-key> and the <translation-key id="Providers">Providers</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key> are not reset.'=>'Confirma que deseas restablecer los <translation-key id="Providers">Proveedores</translation-key>. Se restablecerán los ajustes predeterminados. Tus <translation-key id="Providers">Proveedores</translation-key> personalizados y los <translation-key id="Providers">Proveedores</translation-key> instalados a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key> no se restablecerán.','Backend / Providers / Table HeadlineID'=>'ID','Backend / Providers / Table HeadlineName'=>'Nombre','Backend / Providers / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Providers / Things to know / TextDelete the <translation-key id="Provider">Provider</translation-key>. Not available for the <translation-key id="Provider">Provider</translation-key>: <translation-key id="Owner-of-this-website">Owner of this website</translation-key>.'=>'Eliminar el <translation-key id="Provider">Proveedor</translation-key>. No disponible para el <translation-key id="Provider">Proveedor</translation-key>: <translation-key id="Owner-of-this-website">Propietario de este sitio web</translation-key>.','Backend / Providers / Things to know / TextEdit the <translation-key id="Provider">Provider</translation-key>.'=>'Modificar el <translation-key id="Provider">Proveedor</translation-key>.','Backend / Script Blockers / BreadcrumbEdit: {{ name }}'=>'Modificar: {{ name }}','Backend / Script Blockers / BreadcrumbScript Blockers'=>'Bloqueadores de scripts','Backend / Script Blockers / BreadcrumbNew'=>'Nuevo','Backend / Script Blockers / Field LabelContent Blocker Global JavaScript'=>'Bloqueador de contenido Global JavaScript','Backend / Script Blockers / LabelHandles'=>'Handles','Backend / Script Blockers / LabelID'=>'ID','Backend / Script Blockers / LabelName'=>'Nombre','Backend / Script Blockers / Label<translation-key id="onExist">onExist</translation-key>'=>'<translation-key id="onExist">onExist</translation-key>','Backend / Script Blockers / LabelPhrases'=>'Frases','Backend / Script Blockers / LabelService Opt-in Script Tag'=>'Etiqueta de script para la aceptación del servicio','Backend / Script Blockers / LabelStatus'=>'Estado','Backend / Script Blockers / HeadlineScript Blocker Configuration'=>'Configuración del bloqueador de scripts','Backend / Script Blockers / HeadlineScript Blocker Information'=>'Información sobre el bloqueador de scripts','Backend / Script Blockers / HeadlineScript Blocker Settings'=>'Ajustes del bloqueador de scripts','Backend / Script Blockers / HintIf your intention is to unblock previously blocked JavaScripts upon unblocking a <translation-key id="Content-Blocker">Content Blocker</translation-key>, please insert the provided JavaScript into the <translation-key id="Global">Global</translation-key> field within your <translation-key id="Content-Blocker">Content Blocker</translation-key> settings.'=>'Si tu intención es desbloquear JavaScripts previamente bloqueados al desbloquear un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>, introduce el JavaScript proporcionado en el campo <translation-key id="Global">Global</translation-key> en los ajustes del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>.','Backend / Script Blockers / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'Debe definirse la <translation-key id="ID">ID</translation-key>. La <translation-key id="ID">ID</translation-key> debe tener al menos 3 caracteres y solo puede contener: <strong><em>a-z - _</em></strong>','Backend / Script Blockers / HintThe name of the <translation-key id="Script-Blocker">Script Blocker</translation-key>.'=>'El nombre del <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>.','Backend / Script Blockers / HintTo allow the unblocking of previously blocked JavaScripts through user consent for a <translation-key id="Service">Service</translation-key>, please insert the ensuing script tag into the field labeled <translation-key id="Opt-in-Code">Opt-in Code</translation-key> within your <translation-key id="Service">Service</translation-key>.'=>'Para permitir el desbloqueo de JavaScripts previamente bloqueados mediante el consentimiento del usuario para un <translation-key id="Service">Servicio</translation-key>, introduce la siguiente etiqueta de script en el campo <translation-key id="Opt-in-Code">Código de aceptación</translation-key> en tu <translation-key id="Service">Servicio</translation-key>.','Backend / Script Blockers / HintThe status of this <translation-key id="Script-Blocker">Script Blocker</translation-key>. If the <translation-key id="Script-Blocker">Script Blocker</translation-key> is disabled, it will not block JavaScript.'=>'El estado de este <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>. Si el <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key> está desactivado, no bloqueará JavaScript.','Backend / Script Blockers / Alert MessageNo <translation-key id="Script-Blocker">Script Blocker</translation-key> configured.'=>'No se ha configurado ningún<translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>.','Backend / Script Blockers / HeadlineScript Blockers'=>'Bloqueadores de scripts','Backend / Script Blockers / Table Headline<translation-key id="Handles">Handles</translation-key>'=>'<translation-key id="Handles">Handles</translation-key>','Backend / Script Blockers / Table HeadlineID'=>'ID','Backend / Script Blockers / Table HeadlineName'=>'Nombre','Backend / Script Blockers / Table Headline<translation-key id="On-Exist">OnExist</translation-key>'=>'<translation-key id="On-Exist">OnExist</translation-key>','Backend / Script Blockers / Table Headline<translation-key id="Phrases">Phrases</translation-key>'=>'<translation-key id="Phrases">Frases</translation-key>','Backend / Script Blockers / Table HeadlineStatus'=>'Estado','Backend / Script Blockers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Script-Blockers">Script Blockers</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Script-Blockers">Bloqueadores de scripts</translation-key>?','Backend / Script Blockers / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Script Blockers / Tip / HeadlineLanguage independent'=>'Independiente del idioma','Backend / Script Blockers / Tip / Text<translation-key id="Script-Blockers">Script Blockers</translation-key> are configured independently for all languages.'=>'Los <translation-key id="Script-Blockers">Bloqueadores de scripts</translation-key> se configuran de forma independiente para todos los idiomas.','Backend / Script Blockers / Things to know / TextThe <translation-key id="Script-Blockers">Script Blockers</translation-key> section allows you to block JavaScripts from <translation-key id="Plugins">Plugins</translation-key> whose JavaScript you can\'t enter into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>.'=>'La sección <translation-key id="Script-Blockers">Bloqueadores de scripts</translation-key> te permite bloquear JavaScripts de <translation-key id="Plugins">Plugins</translation-key> cuyo JavaScript no puedas introducir en el campo <translation-key id="Opt-in-Code">Código de aceptación</translation-key> de un <translation-key id="Service">Servicio</translation-key>.','Backend / Script Blockers / Things to know / TextOnce a <translation-key id="Script-Blocker">Script Blocker</translation-key> is created, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> provides an unblock JavaScript that can be entered into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>. The JavaScript becomes unblocked once a visitor consents to the <translation-key id="Service">Service</translation-key>.'=>'Una vez creado un <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> proporciona un JavaScript de desbloqueo que puede introducirse en el campo <translation-key id="Opt-in-Code">Código de aceptación</translation-key> de un <translation-key id="Service">Servicio</translation-key>. El JavaScript se desbloquea una vez que el visitante da su consentimiento para el <translation-key id="Service">Servicio</translation-key>.','Backend / Script Blockers / Things to know / TextThis usually allows you to continue using your favorite plugins, but their JavaScript will only run when a visitor gave consent.'=>'Por lo general, esto te permite seguir utilizando tus plugins favoritos, pero su JavaScript solo se ejecutará cuando un visitante haya dado su consentimiento.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Script-Blocker">Script Blocker</translation-key> is enabled and actively prevents JavaScript execution if the <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key> matches a term configured in the system.'=>'El <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key> está habilitado e impide activamente la ejecución de JavaScript si los <translation-key id="Handles">Handles</translation-key> o <translation-key id="Phrases">Frases</translation-key> coinciden con un término configurado en el sistema.','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Script-Blocker">Script Blocker</translation-key>. Not available for a <translation-key id="Script-Blocker">Script Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Eliminar el <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>. No disponible para un <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key> instalado a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key>.','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Script-Blocker">Script Blocker</translation-key>.'=>'Modificar el <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key>.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Script-Blocker">Script Blocker</translation-key> is inactive, allowing all JavaScript to execute without filtering or restricting based on <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key>.'=>'El <translation-key id="Script-Blocker">Bloqueador de scripts</translation-key> está inactivo y permite la ejecución de todos los JavaScripts sin filtros o restricciones basados en <translation-key id="Handles">Handles</translation-key> o <translation-key id="Phrases">Frases</translation-key>.','Backend / Service Cookie / Alert MessageNo <translation-key id="Cookie">Cookie</translation-key> configured.'=>'No se ha configurado ninguna <translation-key id="Cookie">Cookie</translation-key>.','Backend / Service Cookie / ButtonAdd Cookie'=>'Añadir una cookie','Backend / Service Cookie / FieldLifetime'=>'Duración','Backend / Service Cookie / FieldName'=>'Nombre','Backend / Service Cookie / HeadlineCookies'=>'Cookies','Backend / Service Cookie / Table HeadlineDescription'=>'Descripción','Backend / Service Cookie / Table HeadlineHostname'=>'Nombre de host','Backend / Service Cookie / Table HeadlineLifetime'=>'Duración','Backend / Service Cookie / Table Headline<translation-key id="Name">Name</translation-key>'=>'<translation-key id="Name">Nombre</translation-key>','Backend / Service Cookie / Table HeadlinePath'=>'Ruta','Backend / Service Cookie / Table HeadlinePurpose'=>'Finalidad','Backend / Service Cookie / Table HeadlineType'=>'Tipo','Backend / Services / Things to know / HeadlineYou may input all cookies utilized by the <translation-key id="Service">Service</translation-key> here. Typically, information regarding which cookies are used and their respective purposes can be found on the website of the service you intend to add. For instance, details about the cookies used by Google Analytics can be located in its knowledge base.'=>'Puedes introducir aquí todas las cookies utilizadas por el <translation-key id="Service">Servicio</translation-key>. Normalmente, la información sobre qué cookies se utilizan y sus respectivas finalidades puede encontrarse en el sitio web del servicio que pretendes añadir. Por ejemplo, los detalles sobre las cookies utilizadas por Google Analytics pueden encontrarse en su base de conocimientos.','Backend / Services / Things to know / HeadlineWhat is the purpose of the <translation-key id="Cookies">Cookies</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Cookies">Cookies</translation-key>?','Backend / Services / Things to know / HeadlineInput fields explained'=>'Explicación de los campos de entrada','Backend / Services / Things to know / Headline<translation-key id="Description">Description</translation-key>: Enter a description of the cookie and explain its purpose. This is optional, but recommended.'=>'<translation-key id="Description">Descripción</translation-key>: introduce una descripción de la cookie y explica su finalidad. Esto es opcional, pero recomendado.','Backend / Services / Things to know / HeadlineThe <translation-key id="Cookies">Cookies</translation-key> section of your browser\'s developer tools can be used to find the values for the <translation-key id="Name">Name</translation-key>, <translation-key id="Hostname">Hostname</translation-key>, <translation-key id="Path">Path</translation-key>, and <translation-key id="Lifetime">Lifetime</translation-key> fields.'=>'La sección <translation-key id="Cookies">Cookies</translation-key> de las herramientas para desarrolladores de tu navegador puede utilizarse para encontrar los valores para los campos <translation-key id="Name">Nombre</translation-key>, <translation-key id="Hostname">Nombre de host</translation-key>, <translation-key id="Path">Ruta</translation-key> y <translation-key id="Lifetime">Duración</translation-key>.','Backend / Services / Things to know / Headline<translation-key id="Lifetime">Lifetime</translation-key>: The field generally matches the <translation-key id="Expires">Expires</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. Inform your visitor how many days the cookie will be stored or enter <translation-key id="Session">Session</translation-key> if the cookie is a session cookie and will be deleted when the browser is closed.'=>'<translation-key id="Lifetime">Duración</translation-key>: el campo generalmente coincide con la columna <translation-key id="Expires">Expira</translation-key> de la sección <translation-key id="Cookies">Cookies</translation-key> de tu navegador. Informa a tu visitante de cuántos días se almacenará la cookie o introduce <translation-key id="Session">Sesión</translation-key> si se trata de una cookie de sesión y se eliminará cuando se cierre el navegador.','Backend / Services / Things to know / HeadlineIf you find a date in the <translation-key id="Expires">Expires</translation-key> column, this means that the cookie is a persistent cookie and will be deleted on the specified date.'=>'Si encuentras una fecha en la columna <translation-key id="Expires">Expira</translation-key>, significa que la cookie es persistente y se eliminará en la fecha especificada.','Backend / Services / Things to know / HeadlineIf you find the value <translation-key id="Session">Session</translation-key> in the <translation-key id="Expires">Expires</translation-key> column of your browser, this means that the cookie is a session cookie and will be deleted when you close your browser.'=>'Si encuentras el valor <translation-key id="Session">Sesión</translation-key> en la columna <translation-key id="Expires">Expira</translation-key> de tu navegador, significa que se trata de una cookie de sesión y se eliminará cuando cierres tu navegador.','Backend / Services / Things to know / Headline<translation-key id="Hostname">Hostname</translation-key>: The field generally matches the <translation-key id="Domain">Domain</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. You can enter <strong>#</strong> into this field and <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> will display the domain of your website in the <translation-key id="Dialog">Dialog</translation-key>.'=>'<translation-key id="Hostname">Nombre de host</translation-key>: el campo generalmente coincide con la columna <translation-key id="Domain">Dominio</translation-key> de la sección <translation-key id="Cookies">Cookies</translation-key> de tu navegador. Puedes introducir <strong>#</strong> en este campo y <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> mostrará el dominio de tu sitio web en la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Services / Things to know / Headline<translation-key id="Name">Name</translation-key>: The field generally matches the <translation-key id="Name">Name</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser.'=>'<translation-key id="Name">Nombre</translation-key>: el campo generalmente coincide con la columna <translation-key id="Name">Nombre</translation-key> de la sección <translation-key id="Cookies">Cookies</translation-key> de tu navegador.','Backend / Services / Things to know / Headline<translation-key id="Path">Path</translation-key>: The field generally matches the <translation-key id="Path">Path</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. Usually, the path is <strong>/</strong>.'=>'<translation-key id="Path">Ruta</translation-key>: el campo generalmente coincide con la columna <translation-key id="Path">Ruta</translation-key> de la sección <translation-key id="Cookies">Cookies</translation-key> de tu navegador. Normalmente, la ruta es <strong>/</strong>.','Backend / Services / Things to know / Headline<translation-key id="Purpose">Purpose</translation-key>: We distinguish in two types of <translation-key id="Purposes">Purposes</translation-key>: <translation-key id="Functional">Functional</translation-key> and <translation-key id="Tracking">Tracking</translation-key>.'=>'<translation-key id="Purpose">Finalidad</translation-key>: distinguimos entre dos tipos de <translation-key id="Purposes">Finalidades</translation-key>: <translation-key id="Functional">Funcionales</translation-key> y <translation-key id="Tracking">Rastreo</translation-key>.','Backend / Services / Things to know / Headline<translation-key id="Functional">Functional</translation-key> cookies are required for the basic functionality of the website.'=>'Las cookies <translation-key id="Functional">Funcionales</translation-key> son necesarias para la funcionalidad básica del sitio web.','Backend / Country / CountryNorway'=>'Noruega','Backend / Library / Button TitleRefresh Library'=>'Actualizar la biblioteca','Backend / Country / CountryNepal'=>'Nepal','Backend / Library / Button Title<translation-key id="Button-Reinstall">Reinstall</translation-key>'=>'<translation-key id="Button-Reinstall">Reinstalar</translation-key>','Backend / Country / CountryNauru'=>'Nauru','Backend / Library / Button Title<translation-key id="Button-Uninstall">Uninstall</translation-key>'=>'<translation-key id="Button-Uninstall">Desinstalar</translation-key>','Backend / Country / CountryNiue'=>'Niue','Backend / Library / Button Title<translation-key id="Button-Update">Update</translation-key>'=>'<translation-key id="Button-Update">Actualizar</translation-key>','Backend / Country / CountryNew Zealand'=>'Nueva Zelanda','Backend / Library / Description ListBorlabs Service Modification Date'=>'Fecha de modificación de Borlabs Service','Backend / Country / CountryOman'=>'Omán','Backend / Library / Description ListInstalled at'=>'Instalado en','Backend / Country / CountryPanama'=>'Panamá','Backend / Library / Description ListInstalled Version'=>'Versión instalada','Backend / Country / CountryPeru'=>'Perú','Backend / Library / Description ListLatest Version'=>'Última versión','Backend / Country / CountryFrench Polynesia'=>'Polinesia Francesa','Backend / Library / Description ListType'=>'Tipo','Backend / Country / CountryPapua New Guinea'=>'Papúa Nueva Guinea','Backend / Library / Description ListUpdated at'=>'Actualizado en','Backend / Country / CountryPhilippines'=>'Filipinas','Backend / Library /