ature">Feature</translation-key>, <translation-key id="IAB-TCF-Special-Feature">Special Feature</translation-key>, or <translation-key id="IAB-TCF-Special-Purpose">Special Purpose</translation-key> have been selected in the have been selected in the <translation-key id="Configure-Vendors">Configure Vendors</translation-key> panel. Please ensure that you\'ve made your selections and clicked <translation-key id="Update-Preview">Update Preview</translation-key> to see them in the <translation-key id="Vendors-Preview">Vendors Preview</translation-key> list.'=>'Actualmente, la lista <translation-key id="Vendors-Preview">Vista previa de vendedores</translation-key> está vacía. Esto puede deberse a que no se ha hecho clic en el botón <translation-key id="Update-Preview">Actualizar vista previa</translation-key> para actualizar la lista o a que no se han seleccionado parámetros de consentimiento como <translation-key id="IAB-TCF-Purpose">Finalidad</translation-key>, <translation-key id="IAB-TCF-Feature">Función</translation-key>, <translation-key id="IAB-TCF-Special-Feature">Función especial</translation-key> o <translation-key id="IAB-TCF-Special-Purpose">Finalidad especial</translation-key> en el panel <translation-key id="Configure-Vendors">Configurar vendedores</translation-key>. Asegúrate de haber realizado las selecciones y de haber hecho clic en <translation-key id="Update-Preview">Actualizar vista previa</translation-key> para verlas en la lista <translation-key id="Vendors-Preview">Vista previa de vendedores</translation-key>.','Backend / IAB TCF Configure Vendors / BreadcrumbConfigure Vendors'=>'Configurar vendedores','Backend / IAB TCF Configure Vendors / BreadcrumbIAB TCF'=>'TCF de IAB','Backend / IAB TCF Configure Vendors / ButtonConfigure Vendors'=>'Configurar vendedores','Backend / IAB TCF Configure Vendors / ButtonUpdate Preview'=>'Actualizar vista previa','Backend / IAB TCF Configure Vendors / FieldVendor IDs'=>'ID de los vendedores','Backend / IAB TCF Configure Vendors / FieldReplace Vendor Configuration'=>'Sustituir la configuración de los vendedores','Backend / IAB TCF Configure Vendors / HeadlineConfigure Vendors'=>'Configurar vendedores','Backend / IAB TCF Configure Vendors / HeadlineVendors Preview'=>'Vista previa de vendedores','Backend / IAB TCF Configure Vendors / HintAlternatively, or in addition, you have the option to input the <translation-key id="IDs">IDs</translation-key> of the <translation-key id="Vendors">Vendors</translation-key> you wish to activate. Enter the <translation-key id="Vendor-IDs">Vendor IDs</translation-key> separated by comma.'=>'Como alternativa o de forma adicional, tienes la opción de introducir las <translation-key id="IDs">ID</translation-key> de los <translation-key id="Vendors">Vendedores</translation-key> que deseas activar. Introduce las <translation-key id="Vendor-IDs">ID de los vendedores</translation-key> separadas con comas.','Backend / IAB TCF Configure Vendors / HintIf you enable this option, all existing <translation-key id="Vendors">Vendors</translation-key> will be disabled and only <translation-key id="Vendors">Vendors</translation-key> of this configuration will be enabled. If you leave the option disabled, the <translation-key id="Vendors">Vendors</translation-key> of this configuration will be enabled additionally.'=>'Si activas esta opción, se desactivarán todos los <translation-key id="Vendors">Vendedores</translation-key> existentes y solo se activarán los <translation-key id="Vendors">Vendedores</translation-key> de esta configuración. Si dejas la opción desactivada, se activarán adicionalmente los <translation-key id="Vendors">Vendedores</translation-key> de esta configuración.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Feature">Feature</translation-key> means one of the features of processing personal data used by participants in the Framework that are defined in the Policies or the Specifications used in pursuit of one or several <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> for which the user is not given choice separately to the choice afforded regarding the <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> for which they are used.'=>'<translation-key id="IAB-TCF-Feature">Función</translation-key> se refiere a una de las funciones de tratamiento de datos personales utilizadas por los participantes en el framework que se definen en las políticas o en las especificaciones utilizadas para perseguir una o varias <translation-key id="IAB-TCF-Purposes">Finalidades</translation-key> para las que no se da al usuario la posibilidad de elegir de forma separada a la opción ofrecida en relación con las <translation-key id="IAB-TCF-Purposes">Finalidades</translation-key> para las que se utilizan.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Purpose">Purpose</translation-key> means one of the defined purposes for processing of data, including users’ personal data, by participants in the Framework that are defined in the Policies or the Specifications for which <translation-key id="Vendors">Vendors</translation-key> declare a Legal Basis in the GVL and for which the user is given choice, i.e. to consent or to object depending on the Legal Basis for the processing, by a CMP.'=>'<translation-key id="IAB-TCF-Purpose">Finalidad</translation-key> se refiere a una de las finalidades definidas para el tratamiento de datos, incluidos los datos personales de los usuarios, por parte de los participantes en el framework que se definen en las políticas o en las especificaciones para las que los <translation-key id="Vendors">Vendedores</translation-key> declaran una base jurídica en la GVL y para las que un CMP da al usuario la posibilidad de elegir, es decir, de consentir u oponerse en función de la base jurídica del tratamiento.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Special-Feature">Special Feature</translation-key> means one of the features of processing personal data used by participants in the Framework that are defined in the Policies or the Specifications used in pursuit of one or several <translation-key id="Purposes">Purposes</translation-key> for which the user is given the choice to opt-in separately from the choice afforded regarding the <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> which they support.'=>'<translation-key id="IAB-TCF-Special-Feature">Función especial</translation-key> se refiere a una de las funciones de tratamiento de datos personales utilizadas por los participantes en el framework que se definen en las políticas o en las especificaciones utilizadas para perseguir una o varias <translation-key id="Purposes">Finalidades</translation-key> para las que se da al usuario la posibilidad de elegir la aceptación de forma separada a la opción ofrecida en relación con las <translation-key id="IAB-TCF-Purposes">Finalidades</translation-key> que apoyan.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Special-Purpose">Special Purpose</translation-key> means one of the defined purposes for processing of data, including users’ personal data, by participants in the Framework that are defined in the Policies or the Specifications for which <translation-key id="Vendors">Vendors</translation-key> declare a Legal Basis in the GVL and for which the user is not given choice by a CMP.'=>'<translation-key id="IAB-TCF-Special-Purpose">Finalidad especial</translation-key> se refiere a una de las finalidades definidas para el tratamiento de datos, incluidos los datos personales de los usuarios, por parte de los participantes en el framework que se definen en las políticas o en las especificaciones para las que los <translation-key id="Vendors">Vendedores</translation-key> declaran una base jurídica en la GVL y para las que un CMP no da al usuario la posibilidad de elegir.','Backend / IAB TCF Settings / Alert MessageGlobal Vendor List successfully downloaded.'=>'Lista Global de Vendedores descargada correctamente.','Backend / IAB TCF Settings / BreadcrumbIAB TCF - Settings'=>'TCF de IAB - Ajustes','Backend / IAB TCF Settings / ButtonDownload GVL'=>'Descargar la GVL','Backend / IAB TCF Settings / ButtonUpdate GVL'=>'Actualizar la GVL','Backend / IAB TCF Settings / FieldGlobal Vendor List (GVL) Status'=>'Estado de la Lista Global de Vendedores (GVL)','Backend / IAB TCF Settings / Field<translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key>'=>'<translation-key id="IAB-TCF-Status">Estado del TCF de IAB</translation-key>','Backend / IAB TCF Settings / HeadlineGeneral Settings'=>'Ajustes generales','Backend / Service Groups / HintWhen <translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key> is enabled, certain settings will be overridden or bypassed. For instance, your chosen layout (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key> &raquo; <translation-key id="Layout">Layout</translation-key>) will be substituted with a designated IAB TCF layout. Additionally, the widget (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Widget">Widget</translation-key> &raquo; <translation-key id="Show-Widget">Show Widget</translation-key>) will be turned on and cannot be turned off thereafter.'=>'Cuando se activa el <translation-key id="IAB-TCF-Status">Estado del TCF de IAB</translation-key>, se sobrescribirán o evitarán algunos ajustes. Por ejemplo, tu diseño elegido (<translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Ventana de diálogo</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Ajustes</translation-key> &raquo; <translation-key id="Layout">Diseño</translation-key>) se sustituirá por un diseño TCF de IAB designado. Además, el widget (<translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Widget">Widget</translation-key> &raquo; <translation-key id="Show-Widget">Mostrar widget</translation-key>) se activará y no podrá desactivarse después.','Backend / IAB TCF Settings / TextGlobal Vendor List is downloaded'=>'Se ha descargado la Lista Global de Vendedores','Backend / IAB TCF Settings / TextLast check with API'=>'Última verificación con la API','Backend / IAB TCF Settings / TextGlobal Vendor List is not downloaded'=>'No se ha descargado la Lista Global de Vendedores','Backend / IAB TCF Settings / HintIAB TCF'=>'TCF de IAB','Backend / IAB TCF Settings / HintThe IAB Transparency and Consent Framework (TCF) is a technical standard for the digital advertising industry. It is designed to help all parties in the digital advertising chain ensure that they comply with the EU’s General Data Protection Regulation (GDPR) and ePrivacy Directive when processing personal data or accessing and/or storing information on a user’s device, such as cookies, advertising identifiers, device identifiers and other tracking technologies.'=>'El Transparency and Consent Framework (TCF) de IAB es una norma técnica para el sector de la publicidad digital. Está diseñado para ayudar a todas las partes de la cadena de publicidad digital a garantizar el cumplimiento del Reglamento General de Protección de Datos (RGPD) de la UE y la Directiva sobre la privacidad y las comunicaciones electrónicas a la hora de tratar datos personales o acceder y/o almacenar información en el dispositivo de un usuario, como cookies, identificadores de publicidad, identificadores de dispositivos y otras tecnologías de rastreo.','Backend / IAB TCF Vendor Details / Description ListCookie Max Age (Seconds)'=>'Edad máxima de la cookie (segundos)','Backend / IAB TCF Vendor Details / Description ListData Categories'=>'Categorías de datos','Backend / IAB TCF Vendor Details / Description ListDevice Storage Disclosure URL'=>'URL de divulgación del almacenamiento del dispositivo','Backend / IAB TCF Vendor Details / Description ListLegitimate Interests'=>'Intereses legítimos','Backend / IAB TCF Vendor Details / Description ListLegitimate Interest Claim URL'=>'URL de reivindicación de interés legítimo','Backend / IAB TCF Vendor Details / Description ListPolicy URL'=>'URL de la política','Backend / IAB TCF Vendor Details / Description ListStandard Data Retention'=>'Conservación de datos estándar','Backend / IAB TCF Vendor Details / Description ListUses Cookies'=>'Utiliza cookies','Backend / IAB TCF Vendor Details / Description ListUses Non-Cookie Access'=>'Utiliza acceso sin cookies','Backend / IAB TCF Vendor Details / TextData Retention'=>'Conservación de datos','Backend / IAB TCF Vendor Details / TextDays'=>'Días','Backend / IAB TCF Vendor Details / TextSeconds'=>'Segundos','Backend / IAB TCF / Alert MessageNo <translation-key id="IAB-TCF-Vendor">IAB TCF Vendor</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="IAB-TCF-Vendor">Vendedor TCF de IAB</translation-key>.','Backend / IAB TCF / BreadcrumbIAB TCF'=>'TCF de IAB','Backend / IAB TCF / Button<translation-key id="Configure-Vendors">Configure Vendors</translation-key>'=>'<translation-key id="Configure-Vendors">Configurar vendedores</translation-key>','Backend / IAB TCF / Field<translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key>'=>'<translation-key id="IAB-TCF-Status">Estado del TCF de IAB</translation-key>','Backend / IAB TCF / HeadlineIAB TCF Vendors'=>'Vendedores TCF de IAB','Backend / IAB TCF / PlaceholderSearch Vendor...'=>'Buscar vende