play User ID, Consent History and Service &amp; Service Groups Overview.'=>'Cómo mostrar el ID de usuario, el historial de consentimientos y la visión general de servicios &amp; grupos de servicios','Backend / Dialog Settings / Things to know / HeadlineHow can the visitor perform an opt-out?'=>'¿Cómo puede el visitante realizar un rechazo?','Backend / Dialog Settings / Things to know / HeadlineWhat is <translation-key id="Service-Group-Justification">Service Group Justification</translation-key>?'=>'¿Qué es la <translation-key id="Service-Group-Justification">Justificación del grupo de servicios</translation-key>?','Backend / Dialog Settings / Things to know / TextTo offer this option, enter the following <translation-key id="Shortcode">Shortcode</translation-key> to your privacy page. This will create a button which reopens the <translation-key id="Dialog">Dialog</translation-key>.'=>'Para ofrecer esta opción, introduce el siguiente <translation-key id="Shortcode">Shortcode</translation-key> en tu página de privacidad. Esto creará un botón que vuelve a abrir la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Dialog Settings / Things to know / TextButton'=>'Botón','Backend / Dialog Settings / Things to know / TextLink'=>'Enlace','Backend / Dialog Settings / Things to know / TextUse the <translation-key id="Shortcode">Shortcode</translation-key> below to display the <translation-key id=User-ID">User ID</translation-key>: {{ shortcode }}'=>'Utiliza el siguiente <translation-key id="Shortcode">Shortcode</translation-key> para mostrar la <translation-key id=User-ID">ID de usuario</translation-key>: {{ shortcode }}','Backend / Dialog Settings / Things to know / TextUse the <translation-key id="Shortcode">Shortcode</translation-key> below to display the <translation-key id="Consent-History">Consent History</translation-key>: {{ shortcode }}'=>'Utiliza el siguiente <translation-key id="Shortcode">Shortcode</translation-key> para mostrar el <translation-key id="Consent-History">Historial de consentimientos</translation-key>: {{ shortcode }}','Backend / Dialog Settings / Things to know / TextUse the <translation-key id="Shortcode">Shortcode</translation-key> below to display an overview of all active <translation-key id="Services">Services</translation-key> and <translation-key id="Service-Groups">Service Groups</translation-key>: {{ shortcode }}'=>'Utiliza el siguiente <translation-key id="Shortcode">Shortcode</translation-key> para mostrar una visión general de todos los <translation-key id="Services">Servicios</translation-key> y <translation-key id="Service-Groups">Grupos de servicios</translation-key> activos: {{ shortcode }}','Backend / Dialog Settings / Things to know / TextInsert the following <translation-key id="Shortcode">Shortcode</translation-key> to your privacy page. This will create an opt-out button that allows the visitor to opt-out of the specified <translation-key id="Service">Service</translation-key>: {{ shortcode }}'=>'Inserta el siguiente <translation-key id="Shortcode">Shortcode</translation-key> en tu página de privacidad. Esto creará un botón de rechazo que permite al visitante rechazar el <translation-key id="Service">Servicio</translation-key> especificado: {{ shortcode }}','Backend / Dialog Settings / Things to know / TextYou find the opt-out <translation-key id="Shortcode">Shortcode</translation-key> for each <translation-key id="Service">Service</translation-key> under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Services">Services</translation-key>. Click on a <translation-key id="Service">Service</translation-key>, and you\'ll find the <translation-key id="Opt-out-Shortcode">Opt-out Shortcode</translation-key>.'=>'Encontrarás el <translation-key id="Shortcode">Shortcode</translation-key> de rechazo para cada <translation-key id="Service">Servicio</translation-k