CountryGuatemala'=>'Guatemala','Backend / Dialog Localization / HeadlineService Details Table'=>'Tabla de detalles de los servicios','Backend / Country / CountryGuam'=>'Guam','Backend / Dialog Appearance / HintFor content blocked by a <translation-key id="Content-Blocker">Content Blocker</translation-key>, there is always a button available to open the dialog with provider information. This is the text of the button used to close this dialog.'=>'Para los contenidos bloqueados por un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>, siempre está disponible un botón para abrir la ventana de diálogo con la información sobre el proveedor. Este es el texto del botón utilizado para cerrar esta ventana de diálogo.','Backend / Country / CountryGuinea-Bissau'=>'Guinea-Bisáu','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Dialog-Localization">Dialog Localization</translation-key> texts. They will be reset to their default texts.'=>'Confirma que deseas restablecer todos los textos de <translation-key id="Dialog-Localization">Ventana de diálogo - Localización</translation-key>. Se restablecerán los textos predeterminados.','Backend / Country / CountryGuyana'=>'Guyana','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-IAB-TCF">Dialog - IAB TCF</translation-key>?'=>'¿Qué es la <translation-key id="Dialog-IAB-TCF">Ventana de diálogo - TCF de IAB</translation-key>?','Backend / Country / CountryHong Kong'=>'Hong Kong','Backend / Dialog Localization / HeadlineLegal Information'=>'Información jurídica','Backend / Country / CountryHeard Island and McDonald Islands'=>'Islas Heard y McDonald','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-Details">Dialog Details</translation-key>?'=>'¿Qué es la <translation-key id="Dialog-Details">Ventana de diálogo - Detalles</translation-key>?','Backend / Country / CountryHonduras'=>'Honduras','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>?'=>'¿Qué es la <translation-key id="Dialog-Entrance">Ventana de diálogo - Entrada</translation-key>?','Backend / Country / CountryCroatia'=>'Croacia','Backend / Dialog Localization / TextWhen the <translation-key id="Iab-Tcf-Status">IAB TCF Status</translation-key> setting is enabled (found under <em><translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">IAB TCF</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Settings</translation-key></em>) the dialog entrance will display these texts instead of the <translation-key id="Legal-Information">Legal Information</translation-key> texts.'=>'Cuando el ajuste <translation-key id="Iab-Tcf-Status">Estado del TCF de IAB</translation-key> está activado (ubicado en <em><translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">TCF de IAB</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Ajustes</translation-key></em>), la Ventana de diálogo - Entrada mostrará estos textos en lugar de los de <translation-key id="Legal-Information">Información jurídica</translation-key>.','Backend / Country / CountryHaiti'=>'Haití','Backend / Dialog Localization / TextThe dialog <span class="brlbs-cmpnt-important-text">must</span> inform about the topics: '=>'La ventana de diálogo <span class="brlbs-cmpnt-important-text">debe</span> informar sobre los siguientes temas: ','Backend / Country / CountryHungary'=>'Hungría','Backend / Dialog Localization / TextTexts <span class="brlbs-cmpnt-important-text">must</span> also distinguish between <translation-key id="Vendors">Vendors</translation-key> (TCF Standard) and <translation-key id="Providers">Providers</translation-key> (Non-TCF Standard).'=>'Los textos también <span class="brlbs-cmpnt-important-text">deben</span> distinguir entre <translation-key id="Vendors">Vendedores</translation-key> (norma TCF) y <translation-key id="Providers">Proveedores</translation-key> (fuera de la norma TCF).','Backend / Country / CountryIndonesia'=>'Indonesia','Backend / Dialog Localization / Text<span class="brlbs-cmpnt-important-text">Warning</span>: Should your modifications infringe upon the IAB\'s TCF standards and we are alerted to a complaint from the IAB, your license will be irrevocably terminated without compensation.'=>'<span class="brlbs-cmpnt-important-text">Advertencia</span>: si tus modificaciones infringen las normas TCF de IAB y se nos ha alertado de una reclamación de IAB, tu licencia se cancelará irrevocablemente sin ninguna indemnización.','Backend / Country / CountryIreland'=>'Irlanda','Backend / Dialog Localization / TextShould you harbor any uncertainties regarding the compliance of your proposed alterations with the TCF standard, we strongly encourage you to reach out to us prior to implementing any changes.'=>'Si tienes alguna duda sobre la conformidad de tus modificaciones propuestas con la norma TCF, te recomendamos encarecidamente que te pongas en contacto con nosotros antes de aplicar cualquier cambio.','Backend / Country / CountryIsrael'=>'Israel','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Technology">Technology</translation-key>: The technologies used, for example: cookies and their purpose. The number of <translation-key id="Vendors">Vendors</translation-key> <span class="brlbs-cmpnt-important-text">must</span> also be mentioned with the help of <strong><em>{{ totalVendors }}</em></strong>.'=>'<translation-key id="Tcf-Topic-Technology">Tecnología</translation-key>: las tecnologías utilizadas, por ejemplo: cookies y su finalidad. También <span class="brlbs-cmpnt-important-text">debe</span> mencionarse el número de <translation-key id="Vendors">Vendedores</translation-key> con la ayuda de <strong><em>{{ totalVendors }}</em></strong>.','Backend / Country / CountryIsle of Man'=>'Isla de Man','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Personal-Data">Personal Data</translation-key>: What types of personal data are processed?'=>'<translation-key id="Tcf-Topic-Personal-Data">Datos personales</translation-key>: ¿qué tipos de datos personales se tratan?','Backend / Country / CountryIndia'=>'India','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Legitimate-Interest">Legitimate Interest</translation-key>: You <span class="brlbs-cmpnt-important-text">must</span> inform about the legitimate interest that some <translation-key id="Vendors">Vendors</translation-key> claim for data processing.'=>'<translation-key id="Tcf-Topic-Legitimate-Interest">Interés legítimo</translation-key>: <span class="brlbs-cmpnt-important-text">debes</span> informar sobre el Interés legítimo que alegan algunos <translation-key id="Vendors">Vendedores</translation-key> para el tratamiento de los datos.','Backend / Country / CountryBritish Indian Ocean Territory'=>'Territorio Británico del Océano Índico','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-More-Information">More Information</translation-key>: Where the visitor can find more information about the <translation-key id="Vendors">Vendors</translation-key> and the data processed.'=>'<translation-key id="Tcf-Topic-More-Information">Más información</translation-key>: donde el visitante puede encontrar más información sobre los <translation-key id="Vendors">Vendedores</translation-key> y los datos tratados.','Backend / Country / CountryIraq'=>'Irak','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-No-Commitment">No Commitment</translation-key>: That the visitor can visit the website without giving consent.'=>'<translation-key id="Tcf-Topic-No-Commitment">Sin compromiso</translation-key>: el visitante puede visitar el sitio web sin dar su consentimiento.','Backend / Country / CountryIran'=>'Irán','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Revoke">Revoke</translation-key>: That the visitor can revoke the consent any time.'=>'<translation-key id="Tcf-Topic-Revoke">Revocar</translation-key>: el visitante puede revocar su consentimiento en cualquier momento.','Backend / Country / CountryIceland'=>'Islandia','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Individual-Settings">Individual Settings</translation-key>: That due to individual settings certain functionalities of the website may be unavailable or operate suboptimally.'=>'<translation-key id="Tcf-Topic-Individual-Settings">Ajustes individuales</translation-key>: debido a ajustes individuales, algunas funcionalidades del sitio web pueden no estar disponibles o funcionar de manera no óptima.','Backend / Country / CountryItaly'=>'Italia','Backend / Dialog Localization / TextYou can select which legal information topics you want to show to a visitor.'=>'Puedes seleccionar los temas de información jurídica que deseas mostrar a un visitante.','Backend / Country / CountryJersey'=>'Jersey','Backend / Dialog Localization / TextIf you disable a text, make sure that its message appears or is part of another text displayed to a visitor.'=>'Si desactivas un texto, asegúrate de que su mensaje aparezca o forme parte de otro texto mostrado a un visitante.','Backend / Country / CountryJamaica'=>'Jamaica','Backend / Dialog Localization / TextYou <span class="brlbs-cmpnt-important-text">must</span> inform a visitor about the following topics:'=>'<span class="brlbs-cmpnt-important-text">Debes</span> informar a un visitante sobre los siguientes temas:','Backend / Country / CountryJordan'=>'Jordania','Backend / Dialog Localization / TextA minimum age of 16 is required to consent to non-optional services.'=>'Se requiere una edad mínima de 16 años para dar el consentimiento para los servicios no opcionales.','Backend / Country / CountryJapan'=>'Japón','Backend / Dialog Localization / TextThe used technologies, for example: Cookies.'=>'Las tecnologías utilizadas, por ejemplo: cookies.','Backend / Country / CountryKenya'=>'Kenia','Backend / Dialog Localization / TextWhat type of personal data is used and for what purpose.'=>'Qué tipo de datos personales se utilizan y con qué finalidad.','Backend / Country / CountryKyrgyzstan'=>'Kirguistán','Backend / Dialog Localization / TextWhere more information about each service can be found.'=>'Dónde puede encontrarse más información sobre cada servicio.','Backend / Country / CountryCambodia'=>'Camboya','Backend / Dialog Localization / Text<sup>1</sup> That no consent is required to visit your website.'=>'<sup>1</sup> Que no se requiere ningún consentimiento para visitar tu sitio web.','Backend / Country / CountryKiribati'=>'Kiribati','Backend / Dialog Localization / TextThe visitor can revoke the consent any time.'=>'El visitante puede revocar su consentimiento en cualquier momento.','Backend / Country / CountryComoros'=>'Comoras','Backend / Dialog Localization / Text<sup>1</sup> What happens when individual settings are applied.'=>'<sup>1</sup> Qué ocurre cuando se aplican ajustes individuales.','Backend / Country / CountrySt Kitts and Nevis'=>'San Cristóbal y Nieves','Backend / Dialog Localization / Text<sup>2</sup> That personal data can be transferred to non-eu countries with insufficient data protection.'=>'<sup>2</sup> Que los datos personales pueden transferirse a países no pertenecientes a la UE con una protección de datos insuficiente.','Backend / Country / CountryNorth Korea'=>'Corea del Norte','Backend / Dialog Localization / Text<sup>1</sup> It is recommended to display this information.'=>'<sup>1</sup> Se recomienda mostrar esta información.','Backend / Country / CountrySouth Korea'=>'Corea del Sur','Backend / Dialog Localization / Text<sup>2</sup> You <span class="brlbs-cmpnt-important-text">must</span> display the <translation-key id="Non-EU-Data-Transfer">Non-EU Data Transfer</translation-key> information if you use a service whose company is based in the USA.'=>'<sup>2</sup> <span class="brlbs-cmpnt-important-text">Debes</span> mostrar la información sobre la <translation-key id="Non-EU-Data-Transfer">Transferencia de datos fuera de la UE</translation-key> si utilizas un servicio cuya empresa tiene su sede en EE. UU.','Backend / Country / CountryKuwait'=>'Kuwait','Backend / Dialog Localization / TextThe <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key> is the first thing your visitors see when they visit your website. It is a small dialog that informs your visitors what cookies and services your website uses and that they can change their consent settings in this dialog.'=>'La <translation-key id="Dialog-Entrance">Ventana de diálogo - Entrada</translation-key> es lo primero que ven los visitantes cuando visitan tu sitio web. Es una pequeña ventana de diálogo que informa a los visitantes de qué cookies y servicios utiliza tu sitio web y de la posibilidad de cambiar los ajustes de consentimiento en esta ventana de diálogo.','Backend / Country / CountryCayman Islands'=>'Islas Caimán','Backend / Dialog Localization / TextThe <translation-key id="Dialog-Details">Dialog Details</translation-key> is the dialog that opens when your visitors click on the <translation-key id="Individual-Privacy-Preferences">Individual Privacy Preferences</translation-key> button in the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>. It contains detailed information about the cookies and services your website uses and allows for more granular consent.'=>'La <translation-key id="Dialog-Details">Ventana de diálogo - Detalles</translation-key> es la ventana de diálogo que se abre cuando los visitantes hacen clic en el botón de <translation-key id="Individual-Privacy-Preferences">Preferencias de privacidad individuales</translation-key