equeñas, como las de los smartphones.','Backend / Dialog Appearance / HintBased on the base font size, the font sizes of all elements are automatically adjusted proportionally.'=>'En función del tamaño de fuente base, los tamaños de fuente de todos los elementos se ajustan automáticamente de forma proporcional.','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Dialog-Appearance">Dialog Appearance</translation-key> settings. They will be reset to their default settings.'=>'Confirma que deseas restablecer todos los ajustes de la <translation-key id="Dialog-Appearance">Ventana de diálogo - Apariencia</translation-key>. Se restablecerán los ajustes predeterminados.','Backend / Dialog Appearance / Input PlaceholderEnter custom font family'=>'Introduce la familia de fuente (font-family) personalizada','Backend / Dialog Appearance / Things to know / TextA <translation-key id="Card">Card</translation-key> displays the name and description of a <translation-key id="Service-Group">Service Group</translation-key>.'=>'Una <translation-key id="Card">Tarjeta</translation-key> muestra el nombre y la descripción de un <translation-key id="Service-Group">Grupo de servicios</translation-key>.','Backend / Dialog Appearance / Things to know / HeadlineOn which elements do these settings have a visual impact?'=>'¿Sobre qué elementos tienen un impacto visual estos ajustes?','Backend / Dialog Appearance / Things to know / TextA <translation-key id="Card">Card</translation-key> provides a <translation-key id="List">List</translation-key> of <translation-key id="Services">Services</translation-key> associated with the respective <translation-key id="Service-Group">Service Group</translation-key>.'=>'Una <translation-key id="Card">Tarjeta</translation-key> proporciona una <translation-key id="List">Lista</translation-key> de <translation-key id="Services">Servicios</translation-key> asociados al <translation-key id="Service-Group">Grupo de servicios</translation-key> correspondiente.','Backend / Dialog Appearance / Things to know / TextClick on the image to see what is affected by these settings.'=>'Haz clic en la imagen para ver a qué afectan estos ajustes.','Backend / Dialog Appearance / Things to know / TextTables are typically located in the details section of a <translation-key id="Service">Service</translation-key>, <translation-key id="Provder">Provider</translation-key>, or <translation-key id="Consent-History">Consent History</translation-key>.'=>'Las tablas suelen encontrarse en la sección de detalles de un <translation-key id="Service">Servicio</translation-key>, <translation-key id="Provder">Proveedor</translation-key> o <translation-key id="Consent-History">Historial de consentimientos</translation-key>.','Backend / Settings / BreadcrumbDialog - Localization'=>'Ventana de diálogo - Localización','Backend / Dialog Localization / LabelProvider Dialog - Explanation'=>'Ventana de diálogo de proveedores - Explicación','Seeder / Default Content Blocker / NameDefault'=>'Predeterminado','Backend / Dialog Localization / LabelProvider List - Explanation'=>'Lista de proveedores - Explicación','Seeder / Default Content Blocker / Table HeadlineAccept required service and unblock content'=>'Aceptar el servicio requerido y desbloquear el contenido','Backend / Dialog Localization / LabelService Group List - Explanation'=>'Lista de grupos de servicios - Explicación','Seeder / Default Content Blocker / Button TextYou are currently viewing a placeholder content from <strong>{{ name }}</strong>. To access the actual content, click the button below. Please note that doing so will share data with third-party providers.'=>'Estás viendo un contenido de marcador de posición de <strong>{{ name }}</strong>. Para acceder al contenido real, haz clic en el siguiente botón. Ten en cuenta que al hacerlo compartirás datos con terceros proveedores.','Backend / Dialog Localization / LabelLoading - Text'=>'Carga