itio estén disponibles.','Backend / Dialog Localization / HeadlineCookie URL'=>'URL de la cookie','Frontend / Dialog / TextYou can find more information about the use of your data in our <a href="{{ privacyPageUrl }}">privacy policy</a>.'=>'Puedes encontrar más información sobre el uso de tus datos en nuestra <a href="{{ privacyPageUrl }}">Política de privacidad</a>.','Backend / Dialog Localization / HeadlineDescription'=>'Descripción','Frontend / Dialog / TextThere is no obligation to consent to the processing of your data in order to use this offer.'=>'No es obligatorio dar tu consentimiento al tratamiento de tus datos para utilizar esta oferta.','Frontend / Dialog / TextSome services process personal data in the USA. With your consent to use these services, you also consent to the processing of your data in the USA pursuant to Art. 49 (1) lit. a GDPR. The ECJ classifies the USA as a country with insufficient data protection according to EU standards. For example, there is a risk that U.S. authorities will process personal data in surveillance programs without any existing possibility of legal action for Europeans.'=>'Algunos servicios tratan datos personales en los EE. UU. Con tu consentimiento para utilizar estos servicios, también das tu consentimiento para el tratamiento de sus datos en los EE. UU. de conformidad con el art. 49, apartado 1, letra a), del RGPD. El TJUE clasifica a los EE. UU. como un país con una protección de datos insuficiente según las normas de la UE. Por ejemplo, existe el riesgo de que las autoridades estadounidenses traten datos personales en programas de vigilancia sin que los europeos puedan emprender acciones legales.','Frontend / Dialog / TextPersonal data may be processed (e.g. IP addresses), for example for personalized ads and content or ad and content measurement.'=>'Se pueden tratar datos personales (como direcciones IP), por ejemplo, para anuncios y contenidos personalizados o medición de anuncios y contenidos.','Frontend