/translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers">Bloqueadores de contenido</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers-Appearance">Apariencia</translation-key>.','Backend / Cloud Scan / Field<translation-key id="Scan-type">Scan type</translation-key>'=>'<translation-key id="Scan-type">Tipo de escaneo</translation-key>','Backend / Content Blockers / Things to know / TextThe <translation-key id="Content-Blocker">Content Blocker</translation-key> is active and does block content (iframes) of the configured hosts.'=>'El <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> está activo y bloquea el contenido (iframes) de los hosts configurados.','Backend / Cloud Scan / HeadlineSelect pages to scan'=>'Seleccionar las páginas por escanear','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Content-Blocker">Content Blocker</translation-key>. Not available for <translation-key id="Content-Blocker">Content Blocker</translation-key>: <translation-key id="Content-Blocker-Default">Default</translation-key> or a <translation-key id="Content-Blocker">Content Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Eliminar el <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>. No disponible para el <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>: <translation-key id="Content-Blocker-Default">Predeterminado</translation-key> o un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> instalado a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key>.','Backend / Cloud Scan / TipPages to scan'=>'Páginas por escanear','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Content-Blocker">Content Blocker</translation-key>.'=>'Modificar el <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>.','Backend / Cloud Scan / TipScan type'=>'Tipo de escaneo','Backend / Content Blockers / Things to know / TextThe <translation-key id="Content-Blocker">Content Blocker</translation-key> is inactive is and does not block content (iframes) of the configured hosts.'=>'El <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> está inactivo y no bloquea el contenido (iframes) de los hosts configurados.','Backend / Cloud Scan / TipIf you select this option, the expected scan will be about <strong>{{ numberOfSelectionOfSitesPerPostType }}</strong> pages.'=>'Si seleccionas esta opción, el escaneo previsto será de aproximadamente <strong>{{ numberOfSelectionOfSitesPerPostType }}</strong> páginas.','Backend / Content Blockers Settings / BreadcrumbContent Blocker - Settings'=>'Bloqueador de contenido - Ajustes','Backend / Cloud Scan / Tip<translation-key id="Custom">Custom</translation-key>: Use this option to scan a specific page of your website.'=>'<translation-key id="Custom">Personalizada</translation-key>: utiliza esta opción para escanear una página específica de tu sitio web.','Backend / Content Blockers Settings / LabelHostname(s) Exclusion List'=>'Lista de exclusión de nombre(s) de host(s)','Backend / Cloud Scan / Tip<translation-key id="Homepage">Homepage</translation-key>: Use this option to scan the homepage of your website.'=>'<translation-key id="Homepage">Página de inicio</translation-key>: utiliza esta opción para escanear la página de inicio de tu sitio web.','Backend / Content Blockers Settings / LabelRemove Iframes and more in Feeds'=>'Eliminar iframes y más en los feeds','Backend / Cloud Scan / Tip<translation-key id="Selection-Of-Sites-Per-Post-Type">Selection of sites per post type</translation-key>: Use this option to scan a selection of pages of your website. The scanner selects the homepage, the newest and the oldest page of each post type and its archive.'=>'<translation-key id="Selection-Of-Sites-Per-Post-Type">Selección de páginas por tipo de entrada</translation-key>: utiliza esta opción para escanear una selección de páginas de tu sitio web. El escáner selecciona la página de inicio, la más nueva y la más antigua de cada tipo de entrada y su archivo.','Backend / Content Blockers Settings / Label<translation-key id="Virtual-Hostnames-Exclusion-List">Virtual Hostnames Exclusion List</translation-key>'=>'<translation-key id="Virtual-Hostnames-Exclusion-List">Lista de exclusión de nombres de hosts virtuales</translation-key>','Backend / Cloud Scan / Tip<translation-key id="Audit">Audit</translation-key>: Use this scan type to verify that your website does not load cookies or external resources without obtaining the appropriate consent.'=>'<translation-key id="Audit">Auditoría</translation-key>: utiliza este tipo de escaneo para verificar que tu sitio web no cargue cookies o recursos externos sin obtener el consentimiento adecuado.','Backend / Content Blockers Settings / HeadlineGeneral Settings'=>'Ajustes generales','Backend / Cloud Scan / Tip<translation-key id="Setup">Setup</translation-key>: Use this scan type to determine which cookies or external resources are used by your website. After the scan, you will receive recommendations for packages that you can install to block these cookies or external resources.'=>'<translation-key id="Setup">Configuración</translation-key>: utiliza este tipo de escaneo para determinar qué cookies o recursos externos utiliza tu sitio web. Después del escaneo, recibirás recomendaciones de paquetes que puedes instalar para bloquear estas cookies o recursos externos.','Backend / Content Blockers Settings / HeadlineReset Content Blocker Settings'=>'Restablecer los ajustes del bloqueador de contenido','Backend / Cloud Scan / AlertWe have no additional suggestions.'=>'No tenemos ninguna sugerencia adicional.','Backend / Content Blockers Settings / HintOne <translation-key id="Hostname">Hostname</translation-key> per line. When a <translation-key id="Hostname">Hostname</translation-key> is recognized (for example within the src-attribute of an iframe) the content will not be blocked.'=>'Un <translation-key id="Hostname">Nombre de host</translation-key> por línea. Cuando se reconoce un <translation-key id="Hostname">Nombre de host</translation-key> (por ejemplo, en el atributo src de un iframe), el contenido no se bloquea.','Backend / Cloud Scan / AlertNo external resource found.'=>'No se ha encontrado ningún recurso externo.','Backend / Content Blockers Settings / HintRemoves iframes, blocked content and all output of the <translation-key id="Shortcodes">Shortcodes</translation-key> of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> in feeds. Due technical limitations it is not possible to provide the click-to-load functionality in feeds.'=>'Elimina iframes, contenido bloqueado y todos los resultados de los <translation-key id="Shortcodes">Shortcodes</translation-key> de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en los feeds. Debido a limitaciones técnicas, no es posible proporcionar la funcionalidad de "hacer clic para cargar" en los feeds.','Backend / Cloud Scan / AlertWe found no suggestions.'=>'No hemos encontrado ninguna sugerencia.','Backend / Content Blockers Settings / HintPlease confirm that you want to reset all <translation-key id="Content-Blocker">Content Blocker</translation-key> settings. They will be reset to their default settings.'=>'Confirma que deseas restablecer todos los ajustes del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>. Se restablecerán los ajustes predeterminados.','Backend / Cloud Scan / BreadcrumbScanning'=>'Escaneo','Backend / Content Blockers Settings / HintEvery <translation-key id="Location">Location</translation-key> of a disabled <translation-key id="Content-Blocker">Content Blocker</translation-key> is added to 