tics</span> <small>-</small> <small>Cookie Version {{ cookieVersion }}</small>'=>'<span>Estadísticas</span> <small>-</small> <small>Versión de la cookie {{ cookieVersion }}</small>','Backend / Cloud Scan / TableName'=>'Nombre','Backend / Dashboard / HeadlineImprove Borlabs Cookie'=>'Mejorar Borlabs Cookie','Backend / Cloud Scan / Table<translation-key id="Number-of-resources">Number of resources</translation-key>'=>'<translation-key id="Number-of-resources">Número de recursos</translation-key>','Backend / Dashboard / HeadlineNews'=>'Noticias','Backend / Cloud Scan / TableFound on page'=>'Encontrado en la página','Backend / Dashboard / HeadlinePlugin Updates &amp; Debugging'=>'Actualizaciones de plugins &amp; Depuración','Backend / Cloud Scan / TablePath'=>'Ruta','Backend / Dashboard / HeadlineQuick Start'=>'Inicio rápido','Backend / Cloud Scan / TableResource URL'=>'URL del recurso','Backend / Dashboard / TextDevelopment &amp; Infrastructure'=>'Desarrollo &amp; Infraestructura','Backend / Cloud Scan / TableStatus'=>'Estado','Backend / Dashboard / TextFurther Contributors'=>'Otros colaboradores','Backend / Cloud Scan / TableSuggested package'=>'Paquete sugerido','Backend / Dashboard / Texthere'=>'aquí','Backend / Cloud Scan / TableURL'=>'URL','Backend / Dashboard / TextIn memory of Sergii Kovalenko.'=>'En memoria de Sergii Kovalenko.','Backend / Cloud Scan / Textdays'=>'días','Backend / Dashboard / TextHelp us improve <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> by providing us with non-personal information about your website.'=>'Ayúdanos a mejorar <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> proporcionándonos información no personal sobre tu sitio web.','Backend / Cloud Scan / TextFailed'=>'Error','Backend / Dashboard / TextFor more information about what data we need and for what purpose, <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'Para obtener más información sobre qué datos necesitamos y para qué finalidad, <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>haz clic aquí</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Cloud Scan / TextSuccess'=>'Éxito','Backend / Dashboard / TextThe dialog should now appear on your website. Open your website in incognito/private mode for testing. If you have any questions, please visit our <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Knowledge Base</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'Ahora debe aparecer la ventana de diálogo en tu sitio web. Abre tu sitio web en modo incógnito/privado para probarlo. Si tienes alguna pregunta, visita nuestra <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Base de conocimientos</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Cloud Scan / TextScan in progress'=>'Escaneo en curso','Backend / Dashboard / TextPlease disable your caching plugin if it is currently enabled. Once you have completed the setup of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>, you may re-enable it.'=>'Desabilita tu plugin de almacenamiento en caché si está actualmente habilitado. Una vez que hayas completado la configuración de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>, puedes volver a habilitarlo.','Backend / Cloud Scan / TextScan is analysing'=>'El escáner está analizando','Backend / Dashboard / TextUpdate the default provider data under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-provider"><translation-key id="Navigation-Consent-Management-Providers">Providers</translation-key></a> &raquo; <translation-key id="Owner-of-this-website">Owner of this website</translation-key>. Please update the data by adding your name and address, and ensure to include the URL for the <translation-key id="Privacy-Url">Privacy URL</translation-key>.'=>'Actualiza los datos del proveedor predeterminado en <translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-provider"><translation-key id="Navigation-Consent-Management-Providers">Proveedores</translation-key></a> &raquo; <translation-key id="Owner-of-this-website">Propietario de este sitio web</translation-key>. Actualiza los datos añadiendo tu nombre y dirección y asegúrate de incluir la <translation-key id="Privacy-Url">URL de privacidad</translation-key>.','Backend / Cloud Scan / TextScanning'=>'Escaneando','Backend / Dashboard / TextClick on <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key></a> and select your <translation-key id="Privacy-Page">Privacy Page</translation-key> and <translation-key id="Imprint-Page">Imprint Page</translation-key>. Add both pages to <translation-key id="Hide-Dialog-on-Pages">Hide Dialog on Pages</translation-key> too.'=>'Haz clic en <translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Ventana de diálogo</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Ajustes</translation-key></a> y selecciona tu <translation-key id="Privacy-Page">Página de privacidad</translation-key> y <translation-key id="Imprint-Page">Página de aviso legal</translation-key>. Añade también ambas páginas a <translation-key id="Hide-Dialog-on-Pages">Ocultar ventana de diálogo en las páginas</translation-key>.','Backend / Cloud Scan / TextSession'=>'Sesión','Backend / Dashboard / TextEnable <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> under <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-settings"><translation-key id="Navigation-Settings">Settings</translation-key></a> &raquo; <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>.'=>'Activa <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> en <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-settings"><translation-key id="Navigation-Settings">Ajustes</translation-key></a> &raquo; <translation-key id="Borlabs-Cookie-Status">Estado de Borlabs Cookie</translation-key>.','Backend / Cloud Scan / AlertThe scanner\'s analysis can make suggestions for installing packages that prevent the inclusion of external resources or improve compatibility between the theme and installed plugins.'=>'El análisis del escáner puede hacer sugerencias para instalar paquetes que eviten la inclusión de recursos externos o mejoren la compatibilidad entre el tema y los plugins instalados.','Backend / Dashboard / TextUse our scanner to check which cookies are set on your website and which services are used. Click on <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-cloud-scan"><translation-key id="Navigation-Scanner">Scanner</translation-key></a> &raquo; <translation-key id="Button-Add-New">Add New</translation-key> &raquo; <translation-key id="Button-Create-Scan">Create scan</translation-key> to add a new scan job. The <translation-key id="Scan-type">Scan type</translation-key> should be set to <translation-key id="Setup">Setup</translation-key>. '=>'Utiliza nuestro escáner para comprobar qué cookies están instaladas en tu sitio web y qué servicios se utilizan. Haz clic en <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-cloud-scan"><translation-key id="Navigation-Scanner">Escáner</translation-key></a> &raquo; <translation-key id="Button-Add-New">Añadir nuevo</translation-key> &raquo; <translation-key id="Button-Create-Scan">Crear escaneo</translation-key> para añadir un nuevo trabajo de escaneo. El <translation-key id="Scan-type">Tipo de escaneo</translation-key> debe definirse en <translation-key id="Setup">Configuración</translation-key>. ','Backend / Cloud Scan / AlertClick on the <translation-key id="Button-Details">Details</translation-key> button to get more information about the package. Once the package is installed, you will be redirected back to this page to proceed with the installation of the next package.'=>'Haz clic en el botón <translation-key id="Button-Details">Detalles</translation-key> para obtener más información sobre el paquete. Una vez instalado el paquete, se te redirigirá de nuevo a esta página para proceder a la instalación del siguiente paquete.','Backend / Dashboard / TextAfter you have used the scanner and installed suggested packages, create a new scan job and set <translation-key id="Scan-type">Scan type</translation-key> to <translation-key id="Audit">Audit</translation-key>. This scan type is used to verify that your website does not load cookies or external resources without obtaining the appropriate consent.'=>'Una vez que hayas utilizado el escáner e instalado los paquetes sugeridos, crea un nuevo trabajo de escaneo y establece el <translation-key id="Scan-type">Tipo de escaneo</translation-key> en <translation-key id="Audit">Auditoría</translation-key>. Este tipo de escaneo se utiliza para verificar que tu sitio web no cargue cookies o recursos externos sin obtener el consentimiento adecuado.','Backend / Cloud Scan / TipTo comply with data protection, cookies must be blocked in most cases until consent is given. Only essential cookies may be set without consent. An essential cookie could be one that, for instance, stores the shopping cart contents or the selected language.'=>'Para cumplir con la protección de datos, las cookies deben bloquearse en la mayoría de los casos hasta que se dé el consentimiento. Solo las cookies esenciales pueden instalarse sin consentimiento. Una cookie esencial podría ser, por ejemplo, la que almacena el contenido del carrito de compras o el idioma seleccionado.','Backend / Dashboard / TextExplore our <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-library"><translation-key id="Navigation-Library">Library</translation-key></a> to have an overview of all our available packages. Here you can find templates for <translation-key id="Services">Services</translation-key> (e.g. Google Analytics) or <translation-key id="Content-Blockers">Content Blockers</translation-key> (e.g. YouTube) and much more.'=>'Explora nuestra <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-library"><translation-key id="Navigation-Library">Biblioteca</translation-key></a> para tener una visión general de todos nuestros paquetes disponibles. Aquí puedes encontrar plantillas para <translation-key id="Services">Servicios</translation-key> (por ejemplo, Google Analytics) o <translation-key id="Content-Blockers">Bloqueadores de contenido</translation-key> (por ejemplo, YouTube) y mucho más.','Backend / Cloud Scan / TipClick the icon to view sample locations associated with the detected cookie.'=>'Haz clic en el icono para ver direcciones de muestra asociadas a la cookie detectada.','Backend / Dashboard / TextIf you place ads on your website, you may need to enable the IAB TCF under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-settings"><translation-key id="Navigation-Consent-Management-IAB-TCF-Settings">Settings</translation-key></a> &raquo; <translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key>. And then configure vendors under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-vendor"><translation-key id="Navigation-Consent-Management-IAB-TCF-Manage-Vendors">Manage Vendors</translation-key></a> &raquo; <translation-key id="Configure-Vendors">Configure Vendors</translation-key>.'=>'Si colocas anuncios en tu sitio web, es posible que tengas que activar el TCF de IAB en <translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">TCF de IAB</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-settings"><translation-key id="Navigation-Consent-Management-IAB-TCF-Settings">Ajustes</translation-key></a> &raquo; <translation-key id="IAB-TCF-Status">Estado del TCF de IAB</translation-key>. Después, configura los vendedores en <translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">TCF de IAB</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-vendor"><translation-key id="Navigation-Consent-Management-IAB-TCF-Manage-Vendors">Gestión de vendedores</translation-key></a> &raquo; <translation-key id="Configure-Vendors">Configurar vendedores</translation-key>.','Backend / Cloud Scan / Tip<translation-key id="Suggested-package">Suggested package</translation-key>: This column lists a recommended package to install to block the cookie if the cookie is not essential.'=>'<translation-key id="Suggested-package">Paquete recomendado</translation-key>: esta columna indica un paquete que se recomienda instalar para bloquear la cookie si la cookie no es esencial.','Backend / Dashboard / TextYou can customize the dialog texts under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-localization"><translation-key id="Navigation-Dialog-Widget-Dialog-Localization">Localization</translation-key></a>. The visual appearance (colors, spacing, etc.) can be customized under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-appearance"><translation-key id="Navigation-Dialog-Widget-Dialog-Appearance">Appearance</translation-key></a>. Everything else like layout, position, buttons, etc. you can define under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key></a>.'=>'Puedes personalizar los textos de la ventana de diálogo en <translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Ventana de diálogo</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-localization"><translation-key id="Navigation-Dialog-Widget-Dialog-Localization">Localización</translation-key></a>. La apariencia visual (colores, espacio, etc.) puede personalizarse en <translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Ventana de diálogo</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-appearance"><translation-key id="Navigation-Dialog-Widget-Dialog-Appearance">Apariencia</translation-key></a>. Puedes definir todo lo demás, como el diseño, la posición, los botones, etc., en <translation-key id="Navigation-Dialog-Widget">Ventana de diálogo &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Ventana de diálogo</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Ajustes</translation-key></a>.','Backend / Cloud Scan / TipCookies'=>'Cookies','Backend / Dashboard / TextThank you!'=>'¡Gracias!','Backend / Cloud Scan / TipExternal resources'=>'Recursos externos','Backend / Dashboard / URLhttps://borlabs.io/borlabs-cookie/telemetry/'=>'https://borlabs.io/borlabs-cookie/telemetry/','Backend / Cloud Scan / TipStatus'=>'Estado','Backend / Dashboard / URLhttps://borlabs.io/support/?utm_source=Borlabs+Cookie&utm_medium=Dashboard+Link&utm_campaign=Analysis'=>'https://borlabs.io/support/?utm_source=Borlabs+Cookie&utm_medium=Dashboard+Link&utm_campaign=Analysis','Backend / Cloud Scan / TipExternal resources are resources that are loaded from a different domain than the page itself. For example, if you have a page with the URL <strong><em>https://www.example.com</em></strong> and this page loads a resource from <strong><em>https://www.example.org</em></strong>, then this resource is considered an external resource. To comply with data protection, in most cases, these external resources must be blocked until consent is given.'=>'Los recursos externos son recursos que se cargan desde un dominio diferente al de la propia página. Por ejemplo, si tienes una página con la URL <strong><em>https://www.example.com</em></strong> y esta página carga un recurso de <strong><em>https://www.example.org</em></strong>, este recurso se considera un recurso externo. Para cumplir con la protección de datos, en la mayoría de los casos, estos recursos externos deben bloquearse hasta que se dé el consentimiento.','Seeder / Default Content Blocker / DescriptionThe <strong><em>Default</em> Content Blocker</strong> is a special type that is always used when no specific <strong>Content Blocker</strong> was found.<br>Therefore it is not possible to use the <strong>Unblock all</strong> feature.'=>'El <strong>Bloqueador de contenido <em>predeterminado</em></strong> es un tipo especial que se utiliza siempre que no se haya encontrado ningún <strong>Bloqueador de contenido</strong> específico.<br>Por lo tanto, no es posible utilizar la función <strong>Desbloquear todo</strong>.','Backend / Cloud Scan / TipClick on the icon to get detailed information about the external resource. In the details you can find examples of discovered resources and their respective locations.'=>'Haz clic en el icono para obtener información detallada sobre el recurso externo. En los detalles, encontrarás ejemplos de recursos descubiertos y sus respectivas direcciones.','Backend / Cloud Scan / Tip<translation-key id="External-hostname">External hostname</translation-key>: Resources are being loaded from this source.'=>'<translation-key id="External-hostname">Nombre de host externo</translation-key>: los recursos se cargan desde esta fuente.','Backend / Cloud Scan / Tip<translation-key id="Number-of-resources">Number of resources</translation-key>: The number of resources loaded from this source. The resources found are limited to 10 per hostname.'=>'<translation-key id="Number-of-resources">Número de recursos</translation-key>: el número de recursos cargados desde esta fuente. Los recursos encontrados están limitados a 10 por nombre de host.','Backend / Cloud Scan / Tip<translation-key id="Suggested-package">Suggested package</translation-key>: This column lists a recommended package to install to block the external resource.'=>'<translation-key id="Suggested-package">Paquete recomendado</translation-key>: esta columna indica un paquete que se recomienda instalar para bloquear el recurso externo.','Backend / Cloud Scan / TipFailed: The scanner could not scan the page. More information can be found in the <translation-key id="Failure-type">Failure type</translation-key> column.'=>'Error: el escáner no ha podido escanear la página. Encontrarás más información en la columna <translation-key id="Failure-type">Tipo de error</translation-key>.','Backend / Cloud Scan / TipSuccess: The page was scanned successfully.'=>'Éxito: la página se ha escaneado correctamente.','Backend / Cloud Scan / TipScanning: The page is being scanned.'=>'Escaneando: se está escaneando la página.','Backend / Cloud Scan / AlertNo <translation-key id="Scans">Scans</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Scans">Escaneo</translation-key>.','Backend / Cloud Scan / HeadlineScanner'=>'Escáner','Backend / Cloud Scan / TableCloud Scan ID'=>'ID de escaneo en la nube','Backend / Cloud Scan / TableCreated at'=>'Creado el','Backend / Cloud Scan / TableScanned pages'=>'Páginas escaneadas','Backend / Cloud Scan / TableType'=>'Tipo','Backend / Cloud Scan / Things to know / TextThe scanner will help you set up <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> that will help you make your website privacy compliant. Two scan options are available for this purpose.'=>'El escáner te ayudará a configurar <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>, que te ayudará a hacer que tu sitio web sea conforme a las normas de privacidad. Hay dos opciones de escaneo disponibles para esta finalidad.','Backend / Cloud Scan / Things to know / HeadlineWhat is the functionality of the scanner?'=>'¿Cuál es la funcionalidad del escáner?','Backend / Compatibility Patch Details / Alert MessageError: The required file is missing. To resolve this issue, please reinstall the package.'=>'Error: falta el archivo requerido. Para resolver este problema, vuelve a instalar el paquete.','Backend  / Compatibility Patch Details /  Description ListCalculated Hash'=>'Hash calculado','Backend  / Compatibility Patch Details /  Description ListFile Name'=>'Nombre del archivo','Backend  / Compatibility Patch Details /  Description ListFile Path'=>'Ruta del archivo','Backend  / Compatibility Patch Details /  Description ListID'=>'ID','Backend  / Compatibility Patch Details /  Description ListInstalled at'=>'Instalado el','Backend  / Compatibility Patch Details /  Description ListPackage'=>'Paquete','Backend  / Compatibility Patch Details /  Description ListRequired Hash'=>'Hash requerido','Backend  / Compatibility Patch Details /  Description ListUpdated at'=>'Actualizado el','Backend  / Compatibility Patch Details /  Description ListValid'=>'Válido','Backend  / Compatibility Patch Details /  Description ListVersion'=>'Versión','Backend / Compatibility Patches / Alert MessageNo <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Compatibility-Patch">Parche de compatibilidad</translation-key>.','Backend / Compatibility Patches / BreadcrumbCompatibility Patches'=>'Parches de compatibilidad','Backend / Compatibility Patches / Headline<translation-key id="Compatibility-Patches">Compatibility Patches</translation-key>'=>'<translation-key id="Compatibility-Patches">Parches de compatibilidad</translation-key>','Backend / Compatibility Patches / PlaceholderSearch key or file name...'=>'Buscar clave o nombre de archivo...','Backend / Compatibility Patches / Table HeadlinePackage'=>'Paquete','Backend / Compatibility Patches / Table HeadlineFile name'=>'Nombre del archivo','Backend / Compatibility Patches / Table HeadlineHash'=>'Hash','Backend / Compatibility Patches / Table HeadlineID'=>'ID','Backend / Compatibility Patches / Table HeadlineValid'=>'Válido','Backend / Compatibility Patches / Things to knowClick on the icon to get detailed information about the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key>.'=>'Haz clic en el icono para obtener información detallada sobre el <translation-key id="Compatibility-Patch">Parche de compatibilidad</translation-key>.','Backend / Compatibility Patches / Things to know / HeadlineWhat is the purpose of the <translation-key id="Compatibility-Patches">Compatibility Patches</translation-key> section?'=>'¿Cuál es la finalidad de la sección <translation-key id="Compatibility-Patches">Parches de compatibilidad</translation-key>?','Backend / Compatibility Patches / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Compatibility Patches / Things to knowThe file of the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is invalid. Please reinstall the package via the <translation-key id="Navigation-Library">Library</translation-key> to resolve this issue.'=>'El archivo del <translation-key id="Compatibility-Patch">Parche de compatibilidad</translation-key> no es válido. Vuelve a instalar el paquete a través de la <translation-key id="Navigation-Library">Biblioteca</translation-key> para resolver este problema.','Backend / Compatibility Patches / Things to knowIn this section, you can see all <translation-key id="Compatibility-Patches">Compatibility Patches</translation-key> that have been installed by packages from the <translation-key id="Navigation-Library">Library</translation-key>.'=>'En esta sección, puedes ver todos los <translation-key id="Compatibility-Patches">Parches de compatibilidad</translation-key> que han sido instalados por los paquetes de la <translation-key id="Navigation-Library">Biblioteca</translation-key>.','Backend / Compatibility Patches / Things to knowA <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is used to enhance compatibility with other <translation-key id="Plugins">Plugins</translation-key>, <translation-key id="Themes">Themes</translation-key> external services.'=>'Un <translation-key id="Compatibility-Patch">Parche de compatibilidad</translation-key> se utiliza para mejorar la compatibilidad con otros <translation-key id="Plugins">Plugins</translation-key>, <translation-key id="Themes">Temas</translation-key> y servicios externos.','Backend / Compatibility Patches / Things to knowThe file of the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is valid.'=>'El archivo del <translation-key id="Compatibility-Patch">Parche de compatibilidad</translation-key> es válido.','Backend / Consent Log / Alert MessageThe <translation-key id="Consent-Log">Consent Log</translation-key> could not be found.'=>'No se ha encontrado el <translation-key id="Consent-Log">Registro de consentimiento</translation-key>.','Backend / Consent Log / Breadcrumb<translation-key id="Consent-Logs">Consent Logs</translation-key>'=>'<translation-key id="Consent-Logs">Registros de consentimiento</translation-key>','Backend / Consent Log / BreadcrumbDetails'=>'Detalles','Backend / Consent Log / FieldConsents'=>'Consentimientos','Backend / Consent Log / FieldCookie Version'=>'Versión de la cookie','Backend / Consent Log / LabelIAB TCF TC String'=>'TC String del TCF de IAB','Backend / Consent Log / LabelIs Latest Consent'=>'Es el último consentimiento','Backend / Consent Log / LabelUID'=>'UID','Backend / Consent Log / HintA version number is assigned to the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. It is used to ask the visitor for consent again when changes are made to the cookies. If the version number in the cookie differs from the current version number, the consent dialog appears to the visitor.'=>'Se asigna un número de versión a la cookie de <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Se utiliza para volver a solicitar el consentimiento del visitante cuando se realizan cambios en las cookies. Si el número de versión en la cookie difiere del número de versión actual, la ventana de diálogo de consentimiento se muestra al visitante.','Backend / Consent Log / HintThe <translation-key id="TC-String">TC String</translation-key> is an encoded depiction of user consent choices, generated through interactions with <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. It informs publishers, advertisers, and ad tech vendors of the permitted uses of user data, based on users\' consent decisions.'=>'La <translation-key id="TC-String">TC String</translation-key> es una representación codificada de los consentimientos de los usuarios, generada a través de las interacciones con <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Informa a los editores, anunciantes y vendedores de tecnología publicitaria de los usos permitidos de los datos de los usuarios, sobre la base de sus decisiones de consentimiento.','Backend / Consent Log / HintThe <translation-key id="UID">UID</translation-key> is a unique identifier of the user, generated through interactions with <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'El <translation-key id="UID">UID</translation-key> es un identificador único del usuario, generado a través de las interacciones con <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Consent Log / Alert MessageNo <translation-key id="Consent-Logs">Consent Logs</translation-key> stored.'=>'No hay <translation-key id="Consent-Logs">Registros de consentimiento</translation-key> almacenados.','Backend / Consent Log / Headline<translation-key id="Consent-Logs">Consent Logs</translation-key>'=>'<translation-key id="Consent-Logs">Registros de consentimiento</translation-key>','Backend / Consent Log / PlaceholderSearch UID...'=>'Buscar UID...','Backend / Consent Log / Table HeadlineCookie Version'=>'Versión de la cookie','Backend / Consent Log / Table Headline<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>'=>'<translation-key id="IAB-TCF-Consent">Consentimiento TCF de IAB</translation-key>','Backend / Consent Log / Table HeadlineService Consents'=>'Consentimientos de servicios','Backend / Consent Log / Table HeadlineStamp'=>'Fecha y hora','Backend / Consent Log / Table HeadlineUID'=>'UID','Backend / Consent Log / Things to know / HeadlineClick on the icon to view details of the user\'s consents.'=>'Haz clic en el icono para ver los detalles de los consentimientos del usuario.','Backend / Consent Log / Things to know / TextThe <translation-key id="Consent-Logs">Consent Logs</translation-key> show you the history of the user\'s consents. You can see which services the user has consented to and which not.'=>'Los <translation-key id="Consent-Logs">Registros de consentimiento</translation-key> te muestran el historial de los consentimientos del usuario. Puedes ver para qué servicios ha dado su consentimiento el usuario y para cuáles no.','Backend / Consent Log / Things to know / TextDue to the volume of consent logs that can be accumulated, only consent logs from the past 7 days are displayed here. However, you can access older log entries by inputting the UID into the search field.'=>'Debido al volumen de los registros de consentimiento que pueden acumularse, aquí solo se muestran los registros de consentimiento de los últimos 7 días. No obstante, puedes acceder a registros más antiguos introduciendo el UID en el campo de búsqueda.','Backend / Consent Log / Things to know / HeadlineWhat are Consent Logs?'=>'¿Qué son los registros de consentimiento?','Backend / Consent Log / Things to know / HeadlineSymbols explained'=>'Explicación de los símbolos','Backend / Consent Log / Things to know / Text<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>: The last consent has granted consent to the <translation-key id="IAB-TCF-Vendors">Vendors</translation-key> of the IAB TCF.'=>'<translation-key id="IAB-TCF-Consent">Consentimiento TCF de IAB</translation-key>: el último consentimiento ha otorgado consentimiento a los <translation-key id="IAB-TCF-Vendors">Vendedores</translation-key> del TCF de IAB.','Backend / Consent Log / Things to know / Text<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>: The last consent did not granted consent to the <translation-key id="IAB-TCF-Vendors">Vendors</translation-key> of the IAB TCF.'=>'<translation-key id="IAB-TCF-Consent">Consentimiento TCF de IAB</translation-key>: el último consentimiento no ha otorgado consentimiento a los <translation-key id="IAB-TCF-Vendors">Vendedores</translation-key> del TCF de IAB.','Backend / Content Blockers Appearance / BreadcrumbContent Blocker - Appearance'=>'Bloqueador de contenido - Apariencia','Backend / Content Blockers Appearance / Label<translation-key id="Background-Color">Background Color</translation-key>'=>'<translation-key id="Background-Color">Color de fondo</translation-key>','Backend / Content Blockers Appearance / LabelBorder Radius'=>'Radio de borde (border-radius)','Backend / Content Blockers Appearance / LabelBottom Left'=>'Inferior izquierdo','Backend / Content Blockers Appearance / LabelBottom Right'=>'Inferior derecho','Backend / Content Blockers Appearance / LabelButton'=>'Botón','Backend / Dialog Appearance / LabelButton Border Radius'=>'Radio de borde (border-radius) del botón','Backend / Content Blockers Appearance / LabelButton Color'=>'Color del botón','Backend / Content Blockers Appearance / LabelButton Text Color'=>'Color del texto del botón','Backend / Content Blockers Appearance / LabelContent Blocker'=>'Bloqueador de contenido','Backend / Content Blockers Appearance / LabelDefault'=>'Predeterminado','Backend / Content Blockers Appearance / LabelFont Family'=>'Familia de fuente (font-family)','Backend / Content Blockers Appearance / LabelFont Size (Base)'=>'Tamaño de fuente (base)','Backend / Content Blockers Appearance / LabelHover'=>'Hover','Backend / Content Blockers Appearance / LabelLink Color'=>'Color de enlace','Backend / Content Blockers Appearance / LabelOpacity'=>'Transparencia','Backend / Content Blockers Appearance / LabelSeparator Color'=>'Color del separador (separator)','Backend / Content Blockers Appearance / LabelSeparator Width'=>'Ancho del separador (separator)','Backend / Content Blockers Appearance / LabelText Color'=>'Color del texto','Backend / Content Blockers Appearance / LabelTop Left'=>'Superior izquierdo','Backend / Content Blockers Appearance / LabelTop Right'=>'Superior derecho','Backend / Content Blockers Appearance / HeadlineAppearance Settings'=>'Ajustes de apariencia','Backend / Content Blockers Appearance / HeadlineReset Content Blocker Settings'=>'Restablecer los ajustes de los bloqueadores de contenido','Backend / Content Blockers Appearance / HintDefines the visibility of the <translation-key id="Background-Color">Background Color</translation-key>.'=>'Define la visibilidad del <translation-key id="Background-Color">Color de fondo</translation-key>.','Backend / Content Blockers Appearance / HintChoose which font you want to use. Your themes font is the default setting.'=>'Elige la fuente que deseas utilizar. La fuente de tus temas es la predeterminada.','Backend / Content Blockers Appearance / HintBased on the base font size, the font size of all elements are automatically adjusted proportionally.'=>'En función del tamaño de fuente base, el tamaño de fuente de todos los elementos se ajusta automáticamente de forma proporcional.','Backend / Content Blockers Appearance / HintPlease confirm that you want to reset all <translation-key id="Content-Blockers">Content Blockers</translation-key> settings. They will be reset to their default settings.'=>'Confirma que deseas restablecer todos los ajustes de los <translation-key id="Content-Blockers">Bloqueadores de contenido</translation-key>. Se restablecerán los ajustes predeterminados.','Backend / Content Blockers Appearance / Input PlaceholderEnter custom font family'=>'Introduce la familia de fuente (font-family) personalizada','Backend / Content Blockers Appearance / Things to know / Headline<translation-key id="Content-Blocker">Content Blocker</translation-key> Individual Settings'=>'Ajustes individuales del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>','Backend / Content Blockers Appearance / Things to know / TextPlease note that the settings for <translation-key id="Button-Radius">Button Radius</translation-key>, <translation-key id="Button-Color">Button Color</translation-key>, and <translation-key id="Button-Text-Color">Button Text Color</translation-key> are often overwritten with the individual settings of a <translation-key id="Content-Blocker">Content Blocker</translation-key>.'=>'Ten en cuenta que los ajustes de <translation-key id="Button-Radius">Radio del botón</translation-key>, <translation-key id="Button-Color">Color del botón</translation-key> y <translation-key id="Button-Text-Color">Color del texto del botón</translation-key> a menudo se sobrescriben con los ajustes individuales de un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Content-Blocker">Content Blocker</translation-key> is not available in the current language.'=>'El <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> seleccionado no está disponible en el idioma actual.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> does not match the <translation-key id="Provider">Provider</translation-key> of the <translation-key id="Service">Service</translation-key>.'=>'El <translation-key id="Provider">Proveedor</translation-key> seleccionado no coincide con el <translation-key id="Provider">Proveedor</translation-key> del <translation-key id="Service">Servicio</translation-key>.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> is not available in the current language.'=>'El <translation-key id="Provider">Proveedor</translation-key> seleccionado no está disponible en el idioma actual.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> does not exist.'=>'El <translation-key id="Provider">Proveedor</translation-key> seleccionado no existe.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Service">Service</translation-key> does not exist.'=>'El <translation-key id="Service">Servicio</translation-key> seleccionado no existe.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Service">Service</translation-key> is not available in the current language.'=>'El <translation-key id="Service">Servicio</translation-key> seleccionado no está disponible en el idioma actual.','Backend / Content Blockers / BreadcrumbEdit: {{ name }}'=>'Modificar: {{ name }}','Backend / Content Blockers / BreadcrumbContent Blockers'=>'Bloqueadores de contenido','Backend / Content Blockers / BreadcrumbNew'=>'Nuevo','Backend / Content Blockers / Button TitleApply Preset'=>'Aplicar el preajuste','Backend / Content Blockers / Button TitleSelect or Upload Image'=>'Seleccionar o cargar una imagen','Backend / Content Blockers / Button TitleUse this media'=>'Utilizar este medio','Backend / Content Blockers / LabelHost(s)'=>'Host(s)','Backend / Content Blockers / Label<translation-key id="Global">Global</translation-key>'=>'<translation-key id="Global">Global</translation-key>','Backend / Content Blockers / LabelID'=>'ID','Backend / Content Blockers / LabelName'=>'Nombre','Backend / Content Blockers / LabelPreset'=>'Preajuste','Backend / Content Blockers / Label<translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key>'=>'<translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key>','Backend / Content Blockers / Label<translation-key id="Preview-Blocked-Content-Image">Image</translation-key>'=>'<translation-key id="Preview-Blocked-Content-Image">Imagen</translation-key>','Backend / Content Blockers / LabelProvider List'=>'Lista de proveedores','Backend / Content Blockers / LabelService'=>'Servicio','Backend / Content Blockers / Label<translation-key id="Shortcode">Shortcode</translation-key>'=>'<translation-key id="Shortcode">Shortcode</translation-key>','Backend / Content Blockers / LabelStatus'=>'Estado','Backend / Content Blockers / HeadlineAdditional Settings'=>'Ajustes adicionales','Backend / Content Blockers / HeadlineContent Blocker Information'=>'Información sobre el bloqueador de contenido','Backend / Content Blockers / HeadlineContent Blocker Settings'=>'Ajustes del bloqueador de contenido','Backend / Content Blockers / HeadlineJavaScript'=>'JavaScript','Backend / Content Blockers / Headline<translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key>'=>'<translation-key id="Preview-Blocked-Content">Vista previa del contenido bloqueado</translation-key>','Backend / Content Blockers / HeadlineProvider Information'=>'Información sobre el proveedor','Backend / Content Blockers / HeadlineService Information'=>'Información sobre el servicio','Backend / Content Blockers / HintOnly use JavaScript, do not use <strong><em>&lt;script&gt;</em></strong> tags!'=>'Utilizar solo JavaScript, no utilizar etiquetas <strong><em>&lt;script&gt;</em></strong>.','Backend / Content Blockers / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'Debe definirse la <translation-key id="ID">ID</translation-key>. La <translation-key id="ID">ID</translation-key> debe tener al menos 3 caracteres y solo puede contener: <strong><em>a-z - _</em></strong>','Backend / Content Blockers / HintThe name of the <translation-key id="Content-Blocker">Content Blocker</translation-key> which can be used within the <translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> code by using the variable <strong><em>{{ name }}</em></strong>.'=>'El nombre del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> que puede utilizarse en la <translation-key id="Preview-Blocked-Content">Vista previa del contenido bloqueado</translation-key> &raquo; código <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> utilizando la variable <strong><em>{{ name }}</em></strong>.','Backend / Content Blockers / HintThis CSS will be used for the preview of the blocked content.'=>'Este CSS se utilizará para la vista previa del contenido bloqueado.','Backend / Content Blockers / HintThis HTML will be used as the preview of the blocked content. You can use the following variables within the HTML code: <strong><em>{{ name }}</em></strong> to place the name of the <translation-key id="Content-Blocker">Content Blocker</translation-key> and <strong><em>{{ previewImage }}</em></strong> to place the URL of the <translation-key id="Preview-Blocked-Content-Image">Image</translation-key>.'=>'Este HTML se utilizará como vista previa del contenido bloqueado. Puedes utilizar las siguientes variables en el código HTML: <strong><em>{{ name }}</em></strong> para colocar el nombre del <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> y <strong><em>{{ previewImage }}</em></strong> para colocar la URL de la <translation-key id="Preview-Blocked-Content-Image">Imagen</translation-key>.','Backend / Content Blockers / HintThis image is used as a preview for the blocked content (only with <translation-key id="Preset-B">Preset B</translation-key> and <translation-key id="Preset-C">Preset C</translation-key>). The URL of the image can be accessed within the <translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> with the <strong><em>{{ previewImage }}</em></strong> variable.'=>'Esta imagen se utiliza como vista previa del contenido bloqueado (solo con el <translation-key id="Preset-B">Preajuste B</translation-key> y el <translation-key id="Preset-C">Preajuste C</translation-key>). La URL de la imagen es accesible en la <translation-key id="Preview-Blocked-Content">Vista previa del contenido bloqueado</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> con la variable <strong><em>{{ previewImage }}</em></strong>.','Backend / Content Blockers / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> if automatic detection does not work.'=>'Utiliza este <translation-key id="Shortcode">Shortcode</translation-key> si la detección automática no funciona.','Backend / Content Blockers / HintThe status of this <translation-key id="Content-Blocker">Content Blocker</translation-key>. If enabled it does block content (iframes) of the configured <translation-key id="Locations">Locations</translation-key>.'=>'El estado de este <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>. Si está activado, bloquea el contenido (iframes) de las <translation-key id="Locations">Direcciones</translation-key> configuradas.','Backend / Content Blockers / OptionNo Service'=>'Ningún servicio','Backend / Content Blockers / OptionPreset A - Default'=>'Preajuste A - Predeterminado','Backend / Content Blockers / Option<translation-key id="Preset-B">Preset B</translation-key> - Default + Background Image'=>'<translation-key id="Preset-B">Preajuste B</translation-key> - Predeterminado + Imagen de fondo','Backend / Content Blockers / Option<translation-key id="Preset-C">Preset C</translation-key> - Video Player'=>'<translation-key id="Preset-C">Preajuste C</translation-key> - Reproductor de vídeo','Backend / Content Blockers / Input Placeholder...block this...'=>'...bloquear esto...','Backend / Content Blockers / Things to know / TextThe code is executed in a function that uses the variable <strong><em>el</em></strong> as a parameter. <strong><em>el</em></strong> contains the unlocked object.'=>'El código se ejecuta en una función que utiliza la variable <strong><em>el</em></strong> como parámetro. <strong><em>el</em></strong> contiene el objeto desbloqueado.','Backend / Content Blockers / Things to know / Code Examplefunction (contentBlockerData, el) { /* Here is your initialization code */ }'=>'función (contentBlockerData, el) { /* Here is your initialization code */ }','Backend / Content Blockers / Things to know / HeadlineFor Developers'=>'Para desarrolladores','Backend / Content Blockers / Things to know / HeadlineGlobal JavaScript'=>'Global JavaScript','Backend / Content Blockers / Things to know / HeadlineInitialization JavaScript'=>'Inicialización JavaScript','Backend / Content Blockers / Things to know / HeadlineWhat is the purpose of <translation-key id="Provider">Provider</translation-key> information?'=>'¿Cuál es la finalidad de la información sobre el <translation-key id="Provider">Proveedor</translation-key>?','Backend / Content Blockers / Things to know / HeadlineWhat is the purpose of <translation-key id="Service">Service</translation-key> information?'=>'¿Cuál es la finalidad de la información sobre el <translation-key id="Service">Servicio</translation-key>?','Backend / Content Blockers / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'Explicación del <translation-key id="Shortcode">Shortcode</translation-key>','Backend / Content Blockers / Things to know / TextJavaScript stored in the <translation-key id="Global">Global</translation-key> field is executed once a blocked content is unblocked by the visitor (meaning only once per page). Use this, for example, to load an external JavaScript library.'=>'El JavaScript almacenado en el campo <translation-key id="Global">Global</translation-key> se ejecuta una vez que el visitante desbloquea un contenido bloqueado (es decir, solo una vez por página). Utilízalo, por ejemplo, para cargar una biblioteca JavaScript externa.','Backend / Content Blockers / Things to know / TextTo execute the JavaScript stored in the <translation-key id="Global">Global</translation-key> field before the blocked content is loaded, activate the option <translation-key id="Execute-Global-code-before-unblocking">Execute Global code before unblocking</translation-key>.'=>'Para ejecutar el JavaScript almacenado en el campo <translation-key id="Global">Global</translation-key> antes de que se cargue el contenido bloqueado, activa la opción <translation-key id="Execute-Global-code-before-unblocking">Ejecutar el código Global antes de desbloquear</translation-key>.','Backend / Content Blockers / Things to know / TextIf this option is enabled and a visitor unblocks the content, the JavaScript from the <translation-key id="Global">Global</translation-key> field will be executed before the blocked content is loaded.'=>'Si esta opción está activada y un visitante desbloquea el contenido, el JavaScript del campo <translation-key id="Global">Global</translation-key> se ejecutará antes de que se cargue el contenido bloqueado.','Backend / Content Blockers / Things to know / Code Examplefunction (contentBlockerData) { /* Here is your global code */ }'=>'función (contentBlockerData) { /* Here is your global code */ }','Backend / Content Blockers / Things to know / TextJavaScript stored in the <translation-key id="Initialization">Initialization</translation-key> field is executed with every unblock of blocked content (meaning as many times as the visitor unblocks content). It is executed after the JavaScript from the <translation-key id="Global">Global</translation-key> field.'=>'El JavaScript almacenado en el campo <translation-key id="Initialization">Inicialización</translation-key> se ejecuta cada vez que se desbloquea un contenido bloqueado (es decir, tantas veces como el visitante desbloquee un contenido). Se ejecuta después del JavaScript del campo <translation-key id="Global">Global</translation-key>.','Backend / Content Blockers / Things to know / TextFor legal compliance, every <translation-key id="Content-Blocker">Content Blocker</translation-key> must be linked to a specific <translation-key id="Provider">Provider</translation-key>.'=>'Por motivos de conformidad legal, cada <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> debe estar vinculado a un <translation-key id="Provider">Proveedor</translation-key> específico.','Backend / Content Blockers / Things to know / TextIn the <translation-key id="Provider">Provider</translation-key> section (found under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Providers">Providers</translation-key>), you will find more information and also have the option to edit or create new <translation-key id="Provider">Provider</translation-key> entries.'=>'En la sección <translation-key id="Provider">Proveedor</translation-key> (ubicada en <translation-key id="Navigation-Consent-Management">Gestión de consentimiento</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Providers">Proveedores</translation-key>), encontrarás más información y también tendrás la posibilidad de modificar o crear nuevas entradas de <translation-key id="Provider">Proveedor</translation-key>.','Backend / Content Blockers / Things to know / TextIt\'s optional, but there are two good reasons why you should link a <translation-key id="Content-Blocker">Content Blocker</translation-key> to a specific <translation-key id="Service">Service</translation-key>.'=>'Es opcional, pero hay dos buenas razones para vincular un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> a un <translation-key id="Service">Servicio</translation-key> específico.','Backend / Content Blockers / Things to know / TextLinking a <translation-key id="Content-Blocker">Content Blocker</translation-key> to a <translation-key id="Service">Service</translation-key> enables automatic unblocking of content for visitors upon granting consent to the  <translation-key id="Service">Service</translation-key> through the <translation-key id="Dialog">Dialog</translation-key>.'=>'Vincular un <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key> a un <translation-key id="Service">Servicio</translation-key> permite desbloquear automáticamente el contenido para los visitantes cuando otorgan su consentimiento para el <translation-key id="Service">Servicio</translation-key> a través de la <translation-key id="Dialog">Ventana de diálogo</translation-key>.','Backend / Content Blockers / Things to know / TextYou can extend the information about the <translation-key id="Content-Blocker">Content Blocker</translation-key>, for example with cookie information, via the linked <translation-key id="Service">Service</translation-key>.'=>'Puedes ampliar la información sobre el <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>, por ejemplo, con información sobre las cookies, a través del <translation-key id="Service">Servicio</translation-key> vinculado.','Backend / Content Blockers / Things to know / TextUse the <translation-key id="Shortcode">Shortcode</translation-key> to block content that is not automatically blocked. If contents use the oEmbed format, for example <strong>Pinterest</strong> links, use the <translation-key id="Shortcode">Shortcode</translation-key> to avoid display errors and block the content: {{ shortcode }}'=>'Utiliza el <translation-key id="Shortcode">Shortcode</translation-key> para bloquear contenidos que no se bloquean automáticamente. Si los contenidos utilizan el formato oEmbed, por ejemplo, enlaces de <strong>Pinterest</strong>, utiliza el <translation-key id="Shortcode">Shortcode</translation-key> para evitar errores de visualización y bloquear el contenido: {{ shortcode }}','Backend / Content Blockers / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> is not available until the <translation-key id="Content-Blocker">Content Blocker</translation-key> is created.'=>'El <translation-key id="Shortcode">Shortcode</translation-key> no está disponible hasta que se crea el <translation-key id="Content-Blocker">Bloqueador de contenido</translation-key>.','Backend / Content Blocker / Label<translation-key id="Execute-Global-code-before-unblocking">Execute Global code before unblocking</translation-key>'=>'<translation-key id="Execute-Global-code-before-unblocking">Ejecutar el código Global antes de desbloquear</translation-key>','Backend / Content Blocker / HintIf this option is enabled and a visitor unblocks the content, the JavaScript in the <translation-key id="Global">Global</translation-key> field will be executed before the blocked content is loaded.'=>'Si esta opción está activada (estado: ON) y un visitante desbloquea el contenido, el JavaScript del campo <translation-key id="Global">Global</translation-key> se ejecutará antes de que se cargue el contenido bloqueado.','Backend / Content Blocker Language String / Alert MessageNo <translation-key id="Text-Placeholder">Text Placeholder</translation-key> configured.'=>'No se ha configurado ningún <translation-key id="Text-Placeholder">Marcador de posición de texto</translation-key>.','Backend / Con